INSERT INTO `process` VALUES (1,1,1,'양지머리로 육수를 낸 후 식혀 기름을 걷어낸 후, 불린 쌀을 넣어 고슬고슬하게 밥을 짓는다.'),(2,1,2,'안심은 불고기 양념하여 30분간 재워 국물 없이 구워 한 김 식으면 한입 크기로 자른다.'),(3,1,3,'청포묵은 고기와 비슷한 크기로 잘라 끓는 물에 데쳐내고 계란은 노른자와 흰자를 분리해 지단부쳐 곱게 채썬다.'),(4,1,4,'콩나물과 숙주, 미나리는 데쳐서 국간장과 참기름으로 간하고, 고사리와 도라지는 참기름을 두른 프라이팬에 살짝 볶아놓는다.'),(5,1,5,'밥을 참기름으로 무쳐 그릇에 담고 준비한 재료를 고루 얹는다.'),(6,2,1,'찹쌀과 멥쌀은 깨끗이 씻어 건져 놓는다.'),(7,2,2,'차수수는 붉은 물이 안 나올 때까지 깨끗이 씻어 놓는다.'),(8,2,3,'콩은 불려서 일어 건져놓고, 팥은 삶아서 건져놓고 삶은 물은 받아 놓는다.'),(9,2,4,'차조는 씻어서 잘 일은 후 건져놓는다.'),(10,2,5,'차조를 뺀 모든 재료를 고루 섞어 밥솥에 앉혀 놓고 팥 삶은 물에 소금(1/3작은술 정도)을 넣은 밥물을 붓는데, 밥물은 보통 짓는 밥물보다 20% 적게 붓는다.'),(11,2,6,'밥이 끓기 시작하면 차조를 고루 얹어 뜸을 들인다.'),(12,3,1,'당면은 따뜻한 물에 불려 적당한 길이로 자른다.'),(13,3,2,'고기와 버섯, 채소는 모두 채썬다.'),(14,3,3,'달군 팬에 기름을 두르고 고기와, 버섯, 당근, 고추, 호박을 볶다가 숨이 죽으면 부추를 넣는다.'),(15,3,4,'다진 파, 마늘, 생강을 넣고 소금과 통후추, 진간장을 넣어 간을 한 다음 당면을 넣어 볶아준다.'),(16,3,5,'뜨거운 밥을 그릇에 담고 잡채를 얹어 낸다.'),(17,4,1,'쌀은 미리 씻어 불려놓고 콩나물은 씻어 소금물에 살짝 데쳐 놓는다.'),(18,4,2,'쇠고기는 곱게 다져 파, 마늘, 진간장으로 양념하여 볶는다.'),(19,4,3,'콩나물 삶은 물을 냄비에 붓고 쌀을 앉혀 밥을 짓다가 끓으면 삶은 콩나물과 쇠고기를 얹어 뜸들인다'),(20,4,4,'뜸이 들면 고루 섞어 그릇에 담고 양념장과 함께 낸다.'),(21,5,1,'흰 설탕에 물을 붓고 끓이다가 거품이 일면서 한 부분부터 타기 시작하면 불을 끈다.'),(22,5,2,'압력솥에 물기 뺀 쌀을 담고 분량의 흑설탕, 간장, 참기름, 식물성기름, 계핏가루를 넣고 ①에서 만든 카라멜소스를 부어 물이들게 고루 섞는다.'),(23,5,3,'②에 밤, 대추, 잣을 넣고 섞는다.'),(24,5,4,'물 3컵을 붓고 센불로 가열하다가 끓기 시작하면 중불로 줄여 30분 지난뒤 불을 끄고 남은 열로 뜸들인다.'),(25,6,1,'청동호박은 반을 갈라 씨를 빼고 껍질을 벗긴다.'),(26,6,2,'찹쌀은 깨끗이 씻어 불렸다가 가루로 빻는다.'),(27,6,3,'팥은 씻어 일어 물을 넣고 한소끔 끓으면 첫물은 버리고 다시 물을 부어 푹 끓인다.'),(28,6,4,'호박은 1cm 두께로 썰어 냄비에 담고 물과 설탕을 넣어 푹 끓인다.'),(29,6,5,'호박이 푹 무르면 찹쌀가루를 물에 풀어 넣고 팥도 함께 넣어 끓인다.'),(30,6,6,'다 끓으면 설탕, 소금으로 간한다.'),(31,7,1,'쌀은 충분히 불려서 소쿠리에 건져 놓는다.'),(32,7,2,'깨는 깨끗이 일어 건져서 고소한 향이 나도록 볶는다.'),(33,7,3,'분쇄기에 쌀과 깨를 따로따로 넣어 물을 조금씩 넣어가며 갈아 고운 체에 밭친다.'),(34,7,4,'밑이 두터운 냄비에 곱게 간 쌀과 물을 부어 나무주걱으로 저으며 끓인다.'),(35,7,5,'냄비가 뜨거워 지면 갈은 깨를 조금씩 부어 멍울지지 않도록 가끔 저어주며 끓인다.'),(36,7,6,'확 끓어오르면 불을 약하게 줄이고 잘 섞이도록 서서히 끓인다.'),(37,8,1,'쇠고기와 채소는 도톰하게 깍뚝썰기하여 버터에 볶는다.'),(38,8,2,'카레는 찬물 2컵에 물을 조금씩 넣어가며 풀어놓는다.'),(39,8,3,'①의 냄비에 완두를 넣고 물을 자작하게 붓고 끓이다가 ②를 붓고 더 끓인다.'),(40,8,4,'국물이 되직하게 졸면 우유를 붓고 소금과 후춧가루로 간을 맞춘다.'),(41,8,5,'따뜻한 밥위에 완성된 카레를 넉넉히 얹어낸다.'),(42,9,1,'청피망, 홍피망, 양파, 오이, 당근은 잘게 다져 준비한다.'),(43,9,2,'프라이팬에 버터를 두르고 당근, 양파를 볶다가 양파가 투명해지면 남은 야채 재료를 넣고 볶는다.'),(44,9,3,'찬밥을 넣어 야채와 잘 섞은 후 소금, 후춧가루로 간을 약하게 맞춘다.'),(45,9,4,'계란을 멍울 없이 풀어 소금, 후춧가루로 간하고, 반쯤 익으면 계란 중앙에 밥을 놓고 잘 감싸서 접시에 담는다.'),(46,9,5,'다시마와 멸치로 다시국물을 만들어 체에 거른 후 프라이팬에 육수 2컵을 넣고 쌈장을 잘 풀어 끓여준다.'),(47,9,6,'팔팔 끓어오르면 전분가루를 넣어 농도를 되직하게 만든 후 오므라이스 위에 뿌려준다.'),(48,10,1,'밀가루에 소금과 따뜻한 물을 넣어 말랑하게 반죽하여 젖은 면보에 싸 냉장고에 30분간 넣어둔다.'),(49,10,2,'감자와 애호박은 도톰하게 반달썰기한다.'),(50,10,3,'실파는 4cm 길이로 자르고 홍고추는 어슷썬다.'),(51,10,4,'멸치는 장국을 끓여 국간장으로 간을 맞춘다.'),(52,10,5,'국물이 끓어오르면 감자를 넣고, 반쯤 익으면 수제비 반죽을 얇게 뜯어 넣는다.'),(53,10,6,'호박을 넣어 파랗게 익으면 홍고추와 실파, 참기름을 넣고 불을 끈다.'),(54,11,1,'쇠고기는 삶아 건져 편육으로 썰고 국물은 식혀 기름을 걷어 육수로 준비한다.'),(55,11,2,'동치미무는 길쭉하고 얇게 썰고 오이는 어슷썰어 소금에 20분 동안 절였다가 물기를 꼭 짜서 살짝 볶는다.'),(56,11,3,'배는 납작하게 썰고 계란은 삶아 반 가른다.'),(57,11,4,'육수와 동치미국물을 섞어 소금과 설탕, 식초로 간을 맞춰 차게 둔다.'),(58,11,5,'냉면국수는 삶아 찬물에 비벼 빨듯이 헹군다.'),(59,11,6,'대접에 면을 담고 편육과 무, 오이, 배, 계란을 얹은 후 육수를 부어 낸다.'),(60,12,1,'쇠고기는 채썰어 분량의 재료로 갖은양념하여 약간 재웠다가 팬에 볶는다.'),(61,12,2,'오이는 가늘게 채썰어 소금에 절였다가 물기를 꼭 짜고 살짝 볶아 식힌다.'),(62,12,3,'동치미무는 반달모양으로 얄팍하게 썰어 깨소금과 참기름으로 무친다.'),(63,12,4,'국수는 넉넉한 끓는 물에 삶아 찬물에 헹구어 건져 1인분씩 사리지어 놓는다.'),(64,12,5,'그릇에 국수를 담고 고기채, 오이채, 동치미무, 계란지단채, 붉은 고추채를 얹어 동치미 국물을 가만히 붓는다'),(65,13,1,'열무는 다듬어 소금에 절여둔다.'),(66,13,2,'냄비에 물 1컵과 찹쌀가루 2큰술을 넣고 나무주걱으로 저어가며 약불에서 찹쌀풀을 쑨다.'),(67,13,3,'볼에 물 4컵과 고춧가루 4큰술을 풀고 찹쌀풀을 넣어 간을 맞춘다.'),(68,13,4,'③에 절인 열무와 어슷썬 고추, 채썬 파, 마늘, 생강을 넣고 버무려 열무김치를 담아 익힌다.'),(69,13,5,'알맞게 익은 열무김치에 식초, 설탕, 소금으로 간을 맞추어 차게 둔다.'),(70,13,6,'냉면을 삶아 그릇에 담고 열무김치를 부은 다음 겨자 갠 것을 곁들인다.'),(71,14,1,'오이는 두께 0.3cm x 폭 0.3cm, 길이 5cm로 채썰어 소금에 절였다가 물기를 짠다.'),(72,14,2,'쇠고기는 두께와 폭이 0.3cm, 길이 5cm로 썰어 양념한다.'),(73,14,3,'표고도 물에 불려 쇠고기와 같은 크기로 채썰어 양념한다.'),(74,14,4,'부추는 잘 씻어 5cm 길이로 잘라둔다.'),(75,14,5,'계란은 노른자와 흰자를 분리하여 지단을 붙이고 채썰어 둔다.'),(76,14,6,'번철에 오이, 표고, 쇠고기순으로 볶는다.'),(77,15,1,'고기는 저며서 녹말가루, 계란흰자, 청주, 소금으로 양념한다.'),(78,15,2,'해물은 한 입 크기로 손질해 데친다.'),(79,15,3,'채소는 얄팍하게 저며썬다.'),(80,15,4,'팬에 기름을 둘러 다진 마늘을 볶다가 고기를 넣어 볶는다.'),(81,15,5,'어느정도 익으면 멸치국물을 부어 끓이다가 해물과 채소를 넣고 간을 한다.'),(82,15,6,'삶은 국수에 ⑤의 해물장국을 부어낸다.'),(83,16,1,'김치는 소를 털고 송송 썰어 물기를 꼭 짜고 숙주는 삶아 물기를 뺀다.'),(84,16,2,'갈은 돼지고기나 갈은 쇠고기를 준비한다.'),(85,16,3,'두부는 수분을 완전히 제거한다.'),(86,16,4,'양파, 마늘, 대파는 곱게 다져놓는다.'),(87,16,5,'김치, 숙주, 갈은 고기, 다진 양파, 마늘, 대파에 참기름과 후춧가루, 소금으로 간을 한다.'),(88,16,6,'밀가루 반죽을 하여 얇게 민다음 지름이 6cm 정도 되게 하여 그 안에 ⑤에서 만든 만둣속을 넣는다.'),(89,17,1,'다시마는 두텁고 광택이 있는 것으로 물에 씻어 젖은 행주로 여러 번 닦은 뒤 찬물 5컵에 담가 30분 정도 불렸다가 건져놓는다.'),(90,17,2,'오이는 소금으로 비벼 씻어 헹궈 가늘게 채썬 뒤 찬물에 잠시 담갔다가 건져놓는다.'),(91,17,3,'홍고추는 반으로 갈라 씨를 털어 곱게 채썬다.'),(92,17,4,'손질한 다시마를 돌돌 말아 가늘게 채썰어 달라붙지 않게 털어둔다.'),(93,17,5,'넓은 그릇에 다시마, 채썬 오이, 홍고추를 담고 다진 파와 마늘, 고춧가루, 깨소금, 소금으로 양념하여 차게 해둔 ①을 붓는다.'),(94,18,1,'쇠고기는 얄팍하게 썰어 다진 마늘과 후춧가루, 진간장으로 조물조물 양념한다.'),(95,18,2,'양념한 고기를 냄비에 넣고 육수를 부어 끓이다가 고추장을 연하게 풀고 국간장이나 소금으로 간을 맞춘다.'),(96,18,3,'두부를 1cm 폭으로 길쭉하게 썰어 끓고 있는 국물에 쏟아 넣고 두부가 떠오를 때까지 끓인다.'),(97,18,4,'두부가 떠 오르면 채썬 파, 다진 마늘을 넣고 조금 더 끓인다.'),(98,19,1,'모시조개는 소금물로 해감시킨 후 물을 붓고 끓이다가 모시는 건져내고 국물은 걸러 놓는다.'),(99,19,2,'콩나물은 다듬어 씻고 두부는 큼직하게 썰며, 붉은 고추는 어슷썰어 씨를 털고 실파는 4cm 길이로 썰어 놓는다.'),(100,19,3,'북어포는 물에 씻어 물기를 짠 뒤 소금과 후춧가루로 양념한 뒤 밀가루를 묻혀 계란을 푼 물에 섞는다.'),(101,19,4,'조개 삶아낸 국물에 다진 마늘을 넣고 끓이다가 손질한 콩나물을 넣는다.'),(102,19,5,'한소끔 끓으면 모시조개 두부, 붉은 고추, 실파를 넣고 계란물에 섞어 놓은 북어를 넣어 조금 더 끓이다가 소금, 후춧가루로 간을 한다.'),(103,20,1,'쇠고기는 2cm 길이로 도톰하게 저며썰고 무는 길이 3cm 정도씩 토막을 낸 뒤 반을 갈라 0.2cm 두께로 나박썬다.'),(104,20,2,'썰어놓은 쇠고기는 다진 마늘 1작은술과 국간장 1큰술, 후춧가루 약간으로 양념해 간이 골고루 배도록 조물조물 무친다.'),(105,20,3,'냄비에 물 5컵을 붓고 팔팔 끓이다가 양념해 놓은 쇠고기를 넣고 고기가 익을 때까지 한소끔 끓인다.'),(106,20,4,'끓는 쇠고기 장국에 나박썬 무를 넣는다. 끓을 때 생기는 거품은 걷어낸다.'),(107,20,5,'무가 말갛게 익으면 국간장과 소금을 1:1의 비율로 넣어 간을 하고 다진 마늘과 실파를 넣어 조금 더 끓인다.'),(108,21,1,'찬물에 씻어 담가 충분히 불려 물기를 뺀 뒤 손으로 적당하게 잘라 놓는다.'),(109,21,2,'쇠고기는 연한 살코기만을 골라 곱게 다져 다진 마늘, 국간장, 참기름을 넣고 간이 배도록 고루 섞는다.'),(110,21,3,'냄비에 식용유를 두르고 양념한 쇠고기를 넣어 볶다가 고기가 익으면 손질한 미역을 넣고 같이 볶는다.'),(111,21,4,'미역이 푸른색을 띠게 볶아지면 분량의 물을 붓고 한소끔 끓인 뒤 다진 마늘을 넣고 국간장, 후춧가루로 간을 한다.'),(112,22,1,'미역은 줄기를 떼어 티를 골라낸 다음 찬물에 담가30분 정도 불린다.'),(113,22,2,'불린 미역을 깨끗이 씻어 손으로 잘게 찢은 다음 끓는 물에 재빨리 데쳐 물기를 빼놓는다.'),(114,22,3,'오이는 소금에 비벼 씻어 가늘게 채썰어 찬물에 잠깐 담가 건진다.'),(115,22,4,'대파 흰부분만 다듬어 씻은 다음 반으로 갈라 가늘게 채썬다.'),(116,22,5,'큰 그릇에 데친 미역을 담고 분량의 양념 재료를 넣어 무쳐준다.'),(117,22,6,'양념한 미역에 맛이 배어들면 차갑게 준비한 미역 우린물을 붓고 채썬 오이와 대파를 넣고 차게 먹는다.'),(118,23,1,'생태는 씻어 내장을 빼고 비늘을 긁은 뒤 다시 씻어 5cm 길이로 토막내어 소금을 살짝 뿌려둔다.'),(119,23,2,'콩나물은 뿌리를 떼고 무는 0.5cm 두께로 얄팍하게 나박썬다. 붉은 고추는 어슷썰어 씨를 털고 미나리는 줄기만 4cm 길이로 썬다.'),(120,23,3,'마지막에 씻은 쌀뜨물을 받아 냄비에 붓고 센불에서 끓이다가 손질한 생태를 넣는다.'),(121,23,4,'국물이 끓어 생태가 익으면 무와 콩나물을 넣고 뚜껑을 덮은채 한소끔 끓인다.'),(122,23,5,'거의 끓었을 때 붉은 고추와 다진 마늘, 미나리를 넣고 소금과 후춧가루로 간 한 뒤 더 끓이다가 미나리가 살짝 숨이 죽으면 불에서 내린다.'),(123,24,1,'[연어준비] 신선한 연어는 깨끗하게 포를 3장 떠놓고 포 위에 레몬즙을 발라 놓는다.(미리 발라두면 색이 변하므로 페스토 소스바르기 직전에 한다)'),(124,24,2,'양파는 잘게 다져 놓는다.'),(125,24,3,'양송이는 3mm 두께로 슬라이스 한다.'),(126,24,4,'차이브는 물에 담궈 살려놓는다.'),(127,24,5,'[페스토소스 만들기] 바질, 이태리파슬리, 잣, 엔초비, 마늘을 믹서에 넣고 올리브오일를 넣어 가며 살짝만 갈아 꺼내고, 올리브오일와 파르메쟌을 넣어 농도와 맛을 낸다.'),(128,24,6,'[양송이 샐러드 만들기] 양송이는 5mm두께로 썰어 다진 양파, 레몬주스, 올리브오일, 소금, 후춧가루로 맛을 낸다.'),(129,25,1,'오이는 굵은 소금으로 박박 문질러 씻은 뒤 채썰거나 얇게 통썰기 한다.'),(130,25,2,'손질한 오이에 다진 파와 마늘, 고춧가루, 식초를 넣어 골고루 무쳐놓는다.'),(131,25,3,'물 4컵을 끓였다 식힌 뒤 설탕 1큰술과 간장, 식초 2큰술씩, 소금 약간을 넣고 나머지 6컵의 생수를 넣어 냉국물을 만든다.'),(132,25,4,'상에 낼 때에는 양념해 놓은 오이에 차갑게 식힌 냉국물을 붓고 깨소금을 살짝 뿌린다.'),(133,26,1,'[채소 준비] 양파, 샐러리, 당근을 채썰고 트레비소와 루콜라는 먹기좋은 크기고 자른다.'),(134,26,2,'바질과 이태리파슬리를 다져놓는다.'),(135,26,3,'[해산물 준비] 모든 해산물은 깨끗이 씻어 준비한다.'),(136,26,4,'냄비에 물을 붓고 적당량의 소금을 넣고 끓인다. 물이 끓으면 해산물을 넣고 살짝 데쳐 꺼내놓는다. 채썰어 놓은 채소도 함께 살짝 데쳐 내어 체에 밭쳐둔다.'),(137,26,5,'익은 해산물은 알맞은 크기로 잘라놓고, 채소와 함께 버무려 냉장고에 차갑게 식힌다.'),(138,26,6,'[소스 만들기] 믹싱볼에 올리브오일, 레몬즙, 백포도주식초, 다진 바질, 다진 파슬리, 소금, 후춧가루를 넣고 잘 혼합하여 소스를 완성한다.'),(139,27,1,'재첩은 맹물에 한나절 담가 해감시킨 뒤 깨끗이 문질러 씻어 소쿠리에 건져 놓는다.'),(140,27,2,'냄비에 물 4컵을 붓고 재첩을 넣어 입이 벌어지도록 끓인다.'),(141,27,3,'국물이 끓으면 4cm 길이로 부추를 썰어 넣고 소금으로 간을 하여 잠깐 더 끓인 후 내린다.'),(142,28,1,'신선한 도미는 비늘을 제거하고 3장뜨기 하여 준비한다. 감자는 야주 얇게 둥글게 썰어서 준비한다.'),(143,28,2,'방울토마토는 반을 잘라둔다.'),(144,28,3,'오븐용 종이를 바닥에 깔고 가운데에 올리브오일을 브러쉬를 이용해 잘 바른 후 슬라이스한 감자를 겹겹이 붙여 원형으로 돌려 깔고 위에 소금을 뿌린다.'),(145,28,4,'도미를 올리고 다진 향초를 뿌리고 방울토마토를 생선의 가장자리 부분에 놓는다.'),(146,28,5,'녹색과 검은색 올리브, 바질을 올리고 생선살 위에 와인을 조금 뿌린다.'),(147,28,6,'종이 가장자리에 노른자를 바르고 조금씩 접어 덮고 종이 양쪽은 사탕모양으로 뭉쳐 호일로 끈을 만들어 묶는다. (종이위에 \"ㅍ\" 모양으로 노른자를 바른다. ㅍ모양의 한가운데 내용물이 들어가는것)'),(148,29,1,'쇠고기는 적간으로 도톰하게 떠서 두드리듯 앞 뒤로 잔 칼집을 넣는다.'),(149,29,2,'분량의 갖은 재료를 섞어 고기를 넣고 무쳐 30분 정도 재워 둔다.'),(150,29,3,'느타리버섯은 끓는물에 데쳐 식혀서 물기를 꼭 짠다.'),(151,29,4,'실파는 6cm 길이로 자르고 느타라버섯은 잘게 찢어 놓는다.'),(152,29,5,'햇살담은간장, 파, 마늘, 참기름, 후춧가루로 버섯을 간이 배도록 무친다.'),(153,29,6,'꼬치에 쇠고기, 실파, 느타리버섯을 순서대로 꿰고 마지막엔 쇠고기를 한번 더 꿰어준다.'),(154,30,1,'쇠고기는 잔칼집을 넣어 한 입 크기로 도톰하게 썰어둔다.'),(155,30,2,'피망은 한 입 크기로 네모 썰고 양송이는 모양대로 도톰하게 썬다.'),(156,30,3,'양파는 피망과 같은 크기로 네모 썰고 마늘은 얇게 편썬다.'),(157,30,4,'기름 두른 프라이팬에 쇠고기, 양파, 마늘을 볶다가 분량의 양념 재료를 넣고 끓으면 피망, 양송이를 넣고 숨이 죽으면 불에서 내린다.'),(158,30,5,'소금과 후춧가루를 제외한 분량의 양념재료를 넣어 약불에 졸여 농도가 걸죽해지면 소금과 후춧가루로 간을 해 마무리한다.'),(159,31,1,'붉은 색을 띠는 팥을 준비하여 깨끗이 씻어 돌이 없게 일어 놓았다가 냄비에 담고 물을 넉넉히 부어 삶는다. 한참을 삶아 팥이 푹 물러지면 믹서에 곱게 갈아 체에 걸러 놓는다.'),(160,31,2,'분량의 밀가루와 날콩가루에 소금을 조금 넣고 물 1컵을 조금씩 부어가며 반죽하여 잘 치댄다. 골고루 반죽이 되면 비닐 봉지에 넣고 30분 정도 그대로 두어 끈기가 생기게 한다.'),(161,31,3,'밀가루 반죽에 끈기가 생기면 좀 더 치댄 뒤 편평한 상에 밀가루를 바르고 방망이로 얇게 밀어 0.3cm 두께로 썬다.'),(162,31,4,'체에 걸러 놓은 팥국물을 냄비에 담아 다시 끓인다. 팥물이 끓으면 국수를 넣고 서로 붙지 않게 나무젓가락으로 저어 가며 끓인다.'),(163,31,5,'팥국물이 끓어 국수가 떠오르면 소금으로 간을 하고 불에서 내려 그릇에 담아 낸다.'),(164,32,1,'죽순은 빗살모양을 살려 얇게 저며 썬다.'),(165,32,2,'불린 표고는 기둥을 뗀 후 2, 3등분하여 썬다.'),(166,32,3,'양념장은 간장 1큰술에 다진 파, 마늘, 설탕, 소금, 후춧가루, 참기름을 섞어 만들어 놓는다.'),(167,32,4,'준비한 죽순과 표고를 그릇에 담고 양념장을 넣어 간이 배도록 무친다.'),(168,32,5,'달군 팬에 기름을 두르고 센불에 ④를 넣고 볶다가 마지막으로 파를 넣고 살짝 볶아낸다.'),(169,33,1,'돼지고기는 살만 골라 4cm 길이로 얇게 채썬다. 볼에 넣고 청주와 간장으로 밑간해 둔다.'),(170,33,2,'부추는 씻어 물기를 빼 4cm 길이로 썬다.'),(171,33,3,'표고는 잘 불려서 짜 얇게 채썬다. 굵은 파는 어슷썰고 생강은 다진다.'),(172,33,4,'달군 팬에 기름을 두르고 생강과 파를 볶다가 저민 돼지고기를 넣어 볶는다.'),(173,33,5,'고기가 익으면 남은 재료를 모두 넣어 볶다가 반쯤 익었을 때 간장으로 다시 한번 볶는다. 채소는 너무 숨이 죽지 않도록 한다.'),(174,34,1,'야채는 깨끗이 씻어 손질한 후 찬물에 담가둔다.'),(175,34,2,'두부는 흐르는 물에 한번 헹군 후 물기를 살짝 제거하고 분량의 양념 재료를 넣어 믹서에 곱게 갈아 두부드레싱을 준비한다.'),(176,34,3,'당근은 가로로 얇게 썰고, 파프리카는 굵게 채썬다.'),(177,34,4,'③을 제외한 야채는 물기를 제거하고 적당하게 찢는다.'),(178,34,5,'넓은 접시에 야채를 올리고 두부드레싱을 뿌린다.'),(179,35,1,'콩나물은 줄기가 희고 통통한 것으로 준비하여 뿌리를 다듬어 씻어 물기를 빼놓는다.'),(180,35,2,'냄비에 콩나물을 담고 물을 넣어 뚜껑을 덮고 데친 다음 콩나물을 건져 물기를 뺀다.'),(181,35,3,'②의 콩나물을 참기름으로 먼저 버무린 후 다진 파, 다진 마늘, 실고추, 깨소금, 후춧가루, 소금을 넣어 무친다.'),(182,36,1,'우엉은 칼등으로 가볍게 긁어 껍질을 벗겨 물에 행군다.'),(183,36,2,'긴 것은 4cm 길이로 토막내 굵게 채썬다.'),(184,36,3,'끓는 물에 소금을 넣고 살짝 데쳐 검은 물을 빠지게 한다.'),(185,36,4,'데친 우엉을 냄비에 담고 간장과 물을 붓고 조린다. 조리시 센불에서 서서히 줄여 조린다.'),(186,36,5,'반쯤 조려졌을 때 물엿을 넣고 자작할 때까지 조려낸다.'),(187,36,6,'그릇에 가지런히 담은 뒤 통깨를 솔솔 뿌린다.'),(188,37,1,'바질은 찬물에 헹궈 물기를 제거해준다.'),(189,37,2,'①의 분량의 드레싱재료와 함께 섞어 믹서에 간다.'),(190,37,3,'두부를 지금 6cm 원형 틀로 찍어 낸 다음 1cm 두께로 자른다.'),(191,37,4,'토마토는 윗부분과 아랫부분을 잘라내고 두부와 같이 1cm두께로 자른다.'),(192,37,5,'접시 위에 토마토를 놓고, 그 위에 두부, 다시 토마토 순으로 반복하여 쌓는다.'),(193,37,6,'②의 드레싱과 다진 양파를 섞어 접시 바닥에 뿌리고 두부와 토마토를 찍어 먹는다.'),(194,38,1,'잔 멸치는 체에 담아 살살 흔들어 잔부스러기 없이 손질한다.'),(195,38,2,'당근은 껍질을 벗겨 4cm 길이로 가늘게 채썬다.'),(196,38,3,'청고추는 반으로 갈라 안을 긁어내고 4cm 길이로 채썬다.'),(197,38,4,'팬을 뜨겁게 달군 후 잔멸치, 당근, 청고추 순으로 넣어 센불에 볶는다.'),(198,38,5,'간장, 설탕, 청주를 섞어 만든 조림장을 넣어 간을 맞춘다.'),(199,38,6,'간이 배면 통깨를 솔솔 뿌려 그릇에 낸다.'),(200,39,1,'갈치는 토막내 비늘을 벗기고 칼집을 넣어 준비하며, 대파와 홍고추는 어슷썰고, 마늘은 편썰어 준비한다.'),(201,39,2,'무는 큼직하게 나박썰어 냄비 바닥에 깔아 준비한다.'),(202,39,3,'그릇에 분량의 양념 재료를 넣고 준비한 파와 마늘을 고루 섞는다.'),(203,39,4,'냄비에 깔아 둔 무 위에 갈치를 얹고, 그 위에 ③의 양념장을 얹어 물을 자작하게  부어 끓인다.'),(204,39,5,'15분간 끓이다가 국물이 졸아들면 뚜껑을 열고 파와 고추를 넣은 후 참기름을 넣어 불에서 내린다.'),(205,40,1,'닭은 깨끗이 씻어 먹기 좋은 크기로 8토막 내 뼈를 발라낸 다음 골고루 칼집을 낸다.'),(206,40,2,'넓은 그릇에 다진 파, 마늘, 간장, 고춧가루, 생강즙 등 분량의 양념장 재료를 모두 넣어 섞는다.'),(207,40,3,'닭고기에 양념장을 고루 버무려 30분 정도 재워둔다.'),(208,40,4,'팬에 기름을 두르고 중불에서 너무 바삭해지지 않도록 적당히 익혀낸다.'),(209,41,1,'다시마는 물에 담가 불려서 정사각형으로 잘라 마른 행주로 닦아둔다.'),(210,41,2,'표고버섯은 더운물에 불려 곱게 다진다.'),(211,41,3,'두부는 곱게 으깨어 물기를 꼭 짜둔다.'),(212,41,4,'당근과 풋고추도 곱게 다진다.'),(213,41,5,'2,3,4를 혼합하고 들깨가루, 깨소금, 소금, 참기름, 후추를 넣어 양념을 하여 볶아 식힌다.'),(214,41,6,'1의 다시마에 4의 양념된 두부를 손가락 크기로 만들어 놓고 다시마를 세로로 놓아 김밥처럼 말아서 적당히 자른다.'),(215,42,1,'팥은 찬물에 씻은 후 물에 담가 충분히 불린다.'),(216,42,2,'칼국수면은 손으로 훌훌 털어 뭉침을 풀어준다.'),(217,42,3,'냄비에 불린 팥을 담고 팥의 1.5배의 물과 소금을 약간 넣고 삶는다.'),(218,42,4,'끓기 시작하면 첫물은 따라 버리고 다시 찬물을 붓고 팥이 무를 정도로 삶는다.'),(219,42,5,'④의 팥 삶은 것을 체에 걸러 내려서 팥 껍질을 제거하고 팥앙금과 적정량의 물을 부어 끓인다.(물은 식성에 따라 가감한다)'),(220,42,6,'⑤의 팥물에 생면을 넣어 끓이다가 소금으로 간한다. 식성에 따라 설탕을 첨가해도 좋다.'),(221,43,1,'깨끗이 다듬은 콩나물은 냄비에 안치고 소금을 조금 넣은 후 물 1컵을 붓고 삶는다. 7분 정도 지나면 체에 밭쳐 물기를 뺀다.'),(222,43,2,'물에 불린 표고와 쇠고기는 채썰어 갖은 양념(간장, 설탕, 다진 파, 마늘, 후춧가루, 깨소금) 한다.'),(223,43,3,'미나리는 다듬어 5cm 길이로 썰어 놓는다.'),(224,43,4,'양파와 당근은 채썰어 소금에 절여놓고 계란은 풀어 지단을 부쳐 채썬다.'),(225,43,5,'당근, 미나리를 각각 볶아내고 양념해둔 표고와 쇠고기도 볶는다.'),(226,43,6,'삶은 콩나물에 참기름 1/2큰술과 소금으로 무친다.'),(227,44,1,'양배추는 한장씩 뜯어 끓는 소금물에 살짝 데친 다음 찬물에 헹궈 물기를 짠다.'),(228,44,2,'밤은 속껍질까지 벗겨 찬물에 잠시 담갔다가 끓는물에 반쯤 익을 정도로 데친다.'),(229,44,3,'쇠고기와 양파는 다져서 그릇에 담고 양념장을 넣어 간이 배도록 버무린다. (양념장 : 간장, 깨소금, 청주, 다진 파, 마늘, 참기름, 후춧가루, 소금)'),(230,44,4,'삶은 양배추를 넓게 펼쳐 고기를 적당히 담고 밤 한 개를 다진 고기속에 넣어 동그랗게 만다.'),(231,44,5,'동그랗게 만 양배추말이를 뭉개지지 않을 정도로 실로 묶는다.'),(232,44,6,'냄비에 양배추말이를 안치고 육수를 자작할 정도로 부어 10분 정도 찐다.'),(233,45,1,'마늘은 단단하고 고른것으로 구입하여 물에 충분히 불렸다가 속 껍질까지 벗겨 물기를 완전히 닦아낸다.'),(234,45,2,'마늘을 그릇에 담고 물 10컵에 소금 1컵을 섞은 소금물을 부어 1주일 정도 숙성시킨다.'),(235,45,3,'분량의 장아찌간장을 팔팔 끓여 식힌 후 삭힌 마늘에 붓고 1주일 정도 놓아둔다.'),(236,45,4,'마늘이 잘 삭았으면 장물만 따라내어 팔팔 끓인 다음 식혀서 다시 마늘에 붓는다.'),(237,46,1,'오징어는 내장을 빼고 껍질을 벗겨 한장으로 편 뒤 가로 세로 사선으로 칼집을 낸다.'),(238,46,2,'분량의 재료를 모두 섞어 넓은 그릇에 담고 손질한 오징어를 버무려 15분간 재워둔다.'),(239,46,3,'팬에 기름을 두르고 고추장양념장에 재운 오징어를 놓고 센불에서 뒤집으면서 굽는다.'),(240,46,4,'구운 오징어를 둥글게 말아 한 입에 먹을 수 있도록 1cm 정도로 보기좋게 썬다.'),(241,46,5,'상에 낼때는 몸통모양으로 돌려 담아 먹음직스럽게 모양을 낸다.'),(242,47,1,'대구살은 포를 떠 넓적하게 썬 다음 소금과 생강즙을 조금 뿌려 밑간이 고루 배도록 준비한다.'),(243,47,2,'깨끗이 손질한 양파, 피망, 당근은 먹기 좋은 크기로 썰고 불려 둔 목이버섯은 손으로 잘게 뜯는다.'),(244,47,3,' 통조림 통에서 파인애플 한 조각을 꺼내어 마른 거즈에 잘 닦아낸 다음 8등분하여 준비한다.'),(245,47,4,'준비한 생선에 청주, 계란 흰자, 녹말가루를 넣고 섞어 튀김옷을 골고루 입힌다.'),(246,47,5,'170℃ 정도의 끓는 기름에 튀김옷을 입힌 생선살을 넣고 바삭바삭하게 튀겨낸다.'),(247,47,6,'냄비에 육수를 붓고 끓으면 식초, 설탕, 저민 마늘, 양파, 당근을 넣어 끓이다가 토마토케첩으로 간한다.'),(248,48,1,'갈비는 뼈가 얇고 4.5cm 정도로 토막 낸 것으로 골라 핏물을 우려 낸 후 깨끗이 씻어 물기를 없앤다.'),(249,48,2,'갈비의 기름을 떼고 갈빗대의 중심으로 앞뒤로 뒤집어 가며 양편의 살을 저미면서 얇게 편다.'),(250,48,3,'손질한 갈비는 배즙과 설탕, 청주를 넣어 1시간 정도 재워둔다.'),(251,48,4,'냄비에 간장, 육수, 굵은 파, 양파, 마늘, 월계수잎, 생강을 넣고 재료가 무를 때까지 푹 끓인다.'),(252,48,5,'충분히 끓여 둔 양념장은 체에 걸러 따라 놓는다.'),(253,48,6,'걸러 둔 양념장 5큰술에 양파즙, 물엿, 통깨, 후춧가루, 참기름을 넣고 섞는다.'),(254,49,1,'돼지고기는 0.5cm 두께로 둥글고 두툼하게 썰어 칼집을 넣는다.'),(255,49,2,'고기를 접시에 담고 소금과 후춧가루로 밑간하고 밀가루, 계란, 빵가루 순서대로 튀김옷을 입힌다.'),(256,49,3,'160℃의 기름에 고기를 넣어 앞뒤가 노릇해지도록 튀겨 기름을 빼놓는다.'),(257,49,4,'쇠고기는 잘게 다지고 당근, 샐러리, 마늘은 얇게 저며 썰고 양파는 가늘게 채썰어 볶다가 토마토케첩에 레드와인을 섞어 월계수잎과 육수를 넣고 끓인다.'),(258,49,5,'다른 냄비에 버터를 녹인 다음 밀가루를 넣어 나무주걱으로 저으면서 갈색이 나도록 볶는다.'),(259,49,6,'④의 소스가 끓으면 ⑤의 브라운루를 거품기로 잘 저어 풀어준 후 넣고 약한 불에서 뭉근히 끓인다.'),(260,50,1,'갈비는 토막내어 기름기를 제거하고 찬물에 30분 정도 담가 핏물을 빼서 준비하고, 냄비에 갈비가 잠길 정도로 물을 부어 대파를 흰 뿌리째 넣고 삶는다.'),(261,50,2,'삶은 갈비를 식혀 고루 칼집을 넣어두고 삶아낸 물은 육수로 쓴다.'),(262,50,3,'당근과 무는 밤톨 만하게 썰어 가장자리가 둥글게 모양 내고, 밤은 껍질을 깨끗이 벗겨낸다.'),(263,50,4,'은행은 달구어진 프라이팬에 기름을 두르고 살짝 볶아낸 후 거즈로 닦아 껍질을 벗겨내고, 표고버섯은 채썰며 계란은 흰자와 노른자를 분리하여 지단을 부쳐 준비한다.'),(264,50,5,'배는 강판에 갈아서 준비해두고, 배를 비롯한 분량의 양념 재료를 모두 넣고 고루 섞는다.'),(265,50,6,'냄비에 삶아둔 갈비를 안치고 ⑤의 양념장을 1/2 분량만 끼얹은 후 ②에서 나온 육수 1컵을 부어 끓이다가 갈비가 익고 국물이 졸아들면 남은 양념장을 넣고 준비해둔 밤, 무, 당근, 표고버섯을 넣고 푹 끓인다.'),(266,51,1,'돼지고기는 목살로 덩어리째 준비해 실로 돌려가며 묶는다.'),(267,51,2,'냄비에 물을 붓고 된장을 푼 다음 저민 생강을 넣어 끓이다가 돼지고기를 넣어 무르도록 푹 삶는다.'),(268,51,3,'다 삶아지면 실을 풀고 꼬치로 찔러보아 피가 묻어나지 않으면 된다.'),(269,51,4,'고기를 베보자기나 거즈로 싼 다음 꾹꾹 눌러준다.'),(270,51,5,'고기가 식으면 먹기좋게 0.3cm 두께로 납작하게 저며 썬다.'),(271,51,6,'굴은 묽은 소금물에 살살 흔들어 씻은 다음 티를 골라내고 깨끗한 물에 헹궈 체에 밭친다.'),(272,52,1,'홍합은 신선한 것으로 골라 냄비에 넣고 물, 청주, 파, 소금을 넣어 삶아 건진다. 삶은 홍합은 살만 발라서 수염을 자르고 손질한다.'),(273,52,2,'냄비에 고추장, 간장, 물엿, 청주, 마늘즙, 생강즙, 깨소금, 참기름을 분량대로 넣어 센 불에서 윤기나게 끓여 양념장을 만들어 놓는다.'),(274,52,3,'삶은 홍합을 꼬치에 5개식 차례로 한쪽에 꿴다. 크기가 같은 것끼리 꿰야 보기가 좋다.'),(275,52,4,'꼬치에 꿴 홍합의 앞 뒤에 준비한 양념장을 골고루 발라 10분 정도 재워 간이 배게 한다.'),(276,52,5,'양념한 홍합을 250℃로 15분간 예열한 오븐에 5분 정도 굽다가 뒤집어 3분간 더 구운 뒤 파슬리를 뿌려 낸다.'),(277,53,1,'쇠고기는 기름기 없는 것으로 얇게 저며 썰고 잘 익은 배추김치는 속을 털어내고 먹기 좋게 썬다.'),(278,53,2,'대파는 어슷썰고 무와 두부는 납작하게 썰어놓는다.'),(279,53,3,'냄비에 쇠고기, 김치, 무를 넣고 김치국물을 조금 넣어 볶다가 반 정도 익으면 물 4컵을 부어 끓인다.'),(280,53,4,'고기가 익으면 청국장을 풀고 끓을 때 다진 마늘을 넣는다.'),(281,53,5,'③을 뚝배기에 옮겨 담고 한소끔 끓이다가 대파와 두부를 넣는다.'),(282,53,6,'상에 내기 직전에 소금으로 간을 맞춘 뒤 불에서 내린다.'),(283,54,1,'바지락은 소금물에 담가 해감한다. 해감한 조개는 냄비에 물을 붓고 끓여 입이 벌어지면 조개는 건져내고 국물은 체에 걸러 놓는다.'),(284,54,2,'돼지고기는 기름을 떼서 저며썰고 배추김치는 속을 털어내고 잘게 썬다.'),(285,54,3,'양파는 반으로 갈라 채썰고 굵은 파는 어슷썬다.'),(286,54,4,'냄비에 기름을 두르고 김치, 돼지고기, 양파, 다진 마늘, 고춧가루를 넣어 볶다가 조갯국물을 넣고 끓인다.'),(287,54,5,'돼지고기와 김치가 익으면 뚝배기에 옮겨 담고 숟가락으로 순두부를 뚝뚝 떠 넣는다.'),(288,54,6,'바지락과 굵은 파를 넣고 한소끔 끓으면 소금, 후춧가루를 넣어 간을 맞춘다.'),(289,55,1,'동태는 비늘을 긁고 내장을 제거한 후 5cm 길이로 토막 낸다.'),(290,55,2,'무는 0.5cm 두께로 나박썰고 애호박은 도톰하게 반달썬다.'),(291,55,3,'청고추, 홍고추, 대파는 어슷썬다.'),(292,55,4,'두부는 1cm x 4cm x 3cm 크기로 썬다.'),(293,55,5,'냄비에 물 또는 육수를 붓고 고추장을 풀어 끓으면 무와 동태를 넣은 뒤 남은 재료를 모두 넣고 끓이면서 소금으로 간을 맞춘다.'),(294,56,1,'잘 익은 배추김치는 속을 털고 5cm 길이로 썬다. 너무 신 김치는 물에 한번 헹궈 사용한다. 설탕을 1/2 큰술 넣으면 신 맛이 줄어둔다.'),(295,56,2,'돼지고기는 기름이 약간 섞인 것으로 준비해 한 입 크기로 납작하게 썬다.'),(296,56,3,'가래떡은 씻어 건져 물기를 빼 놓고 굵은 파는 반으로 갈라 5cm 길이로 쭉쭉 찢어 놓는다.'),(297,56,4,'분량의 고춧가루에 다진 마늘, 생강, 청주를 넣고 고루 섞어 양념 고춧가루를 만들어 놓은 뒤 30분정도 재워둔다.'),(298,56,5,'준비한 김치를 먼저 안치고 양념 고춧가루를 고루 끼얹은 다음 납작 썬 돼지고기, 굵은 파, 다진 마늘, 참기름을 넣고 육수 4컵을 부어 끓인다.'),(299,56,6,'센 불에 끓이면서 김치가 어느정도 물러 지면 준비한 가래떡을 함께 넣고 중불에서 서서히 끓인다.'),(300,57,1,'깨끗이 씻은 콩은 물에 담가 하룻밤 정도 불려서 4배로 불려지면 손으로 비벼 껍질을 벗긴다.'),(301,57,2,'통통하게 불린 콩을 믹서에 넣고 물 3컵을 조금씩 부어가며 되직할 정도로 갈아 콩비지를 만든다.'),(302,57,3,'살코기로 준비한 돼지고기는 한 입 크기로 얄팍하게 납작썰기하고 배춧잎은 데쳐서 1cm 정도로 송송 썬다.'),(303,57,4,'다진 파, 마늘, 참기름으로 돼지고기와 배춧잎을 양념한 다음 냄비에 기름을 두르고 함께 볶는다.'),(304,57,5,'돼지고기가 익으면 콩비지를 넣고 서서히 끓이다가 끓어오르면 소금으로 간을 맞추어 한소끔 더 끓인다.'),(305,57,6,'간장 3큰술에 다진 파, 마늘, 고춧가루, 참기름, 깨소금을 넣고 고루 섞어서 콩비지찌개에 곁들인다.'),(306,58,1,'잘 마른 황태를 골라 방망이로 두드려 부드러워지면 물에 불렸다가 잘 다듬어 5cm 길이로 자른 뒤 냄비에 물 4컵을 붓고 끓여 북어는 건져서 손으로 찢는다.'),(307,58,2,'콩나물은 다듬어 씻고 두부는 4cm 길이로 길게 썬다.'),(308,58,3,'홍고추와 굵은 파는 어슷썬다.'),(309,58,4,'찢어놓은 북어를 그릇에 담아 소금과 참기름을 넣고 양념한 후 계란 2개를 넣어 고루 섞는다.'),(310,58,5,'북어국물에 콩나물과 홍고추를 넣고 끓이다가 계란물에 섞은 북어를 한 숟가락씩 넣고 소금, 후춧가루로 간한다.'),(311,58,6,'북어가 떠오르면 두부와 파, 다진 마늘을 넣고 살짝 끓인 후 불에서 내린다.'),(312,59,1,'유부는 기름을 떼고 어슷하게 반으로 갈라 끓는물에 데쳐 찬물에 헹궈 부드럽게 해 놓는다.'),(313,59,2,'준비한 우엉, 당근은 깨끗이 씻어 곱게 다진다.'),(314,59,3,'분량의 재료를 넣어 만든 조림장을 끓이다가 다진 우엉, 당근, 쇠고기를 넣고 국물이 없어질 때 까지 은근하게 조린다.'),(315,59,4,'채소와 고기가 어느정도 조려지면 마지막에 유부를 뒤집어 넣고 뒤적여 맛을 들인다.'),(316,59,5,'고슬고슬하게 지은 밥에 조린 우엉, 당근, 고기를 넣어 골고루 잘 섞어준다.'),(317,59,6,'간이 밴 유부를 왼손에 뒤집어 잡고 오른손으로 밥을 꼭꼭 눌러 유부 안으로 넣은 다음 오므린다.'),(318,60,1,'쌀과 물의 양을 1:1 비율로 잡고 다시마 1장과 청주, 소금을 넣어 밥을 짓고, 뜨거울 때 넓은 그릇에 담아 식초, 소금, 설탕을 섞어 만든 배합초를 고루 뿌려가며 섞으면서 식힌다.'),(319,60,2,'쇠고기는 곱게 갈아 간장, 설탕, 후춧가루로 간하여 프라이팬에 기름을 두르고 볶아두고, 잔멸치는 기름 두른 뜨거운 프라이팬에 한번 볶은 후 설탕과 간장을 1:2의 비율로 넣고 살짝 조려 물엿을 섞어 맛을 낸다.'),(320,60,3,'표고버섯은 미지근한 물에 불려 기둥을 떼고 물기를 꼭 짠 후 채썰어서 간장, 참기름, 설탕, 후춧가루로 양념하여 프라이팬에 볶는다.'),(321,60,4,'단무지는 곱게 채썰어 물기를 뺀 후 식초, 설탕, 소금을 넣고 버무린 다음 고춧가루로 살짝 물들인다.'),(322,60,5,'김치는 익은 것으로 하되 식성에 따라 행궈서 사용해도 좋다. 곱게 채썰어 꼭 짜서 깨소금, 참기름으로 무친다.'),(323,60,6,'다섯가지 재료가 완성되면 준비한 밥을 다섯 등분으로 나누어 속재료를 한가지씩 묻혀서 갖가지 모양을 만든다.'),(324,61,1,'해파리는 먼저 소금물에서 3시간 정도 우려서 짠맛을 뺀 뒤 냉수에 헹궈 50℃ 정도의 따뜻한 물에 담근다. 해파리가 쪼글쪼글해지면 다시 물을 갈아 담갔다가 소쿠리에 건져 물기를 꼭 짠다.'),(325,61,2,'넓고 큰 것은 가로 세로 10cm 정도로 잘라 둥글게 말아 가늘게 채썬다. 찬물에 헹궈내어 물기를 꼭 짜서 냉장고에 차게 둔다.'),(326,61,3,'오이는 굵은 소금으로 문질러 씻은 후 가늘게 채썰어 찬물에 10분 정도 담갔다 건진다.'),(327,61,4,'게맛살은 채썬 해파리와 같은 굵기로 결대로 찢는다.'),(328,61,5,'곁들일 토마토는 단면으로 약간 도톰하게 썬다.'),(329,61,6,'소스는 다진 마늘에 분량의 식초, 육수, 설탕, 간장, 소금, 참기름을 넣고 고루 섞는다.'),(330,62,1,'배추는 고를 때 속이 꽉차고 묵직한 것으로 골라 큰 것은 4등분 작은 것은 2등분한다. 농도가 15% 정도 된 소금물에 담갔다가 꺼낸 후 굵은소금을 뿌려 5~6시간동안 절여둔다.'),(331,62,2,'잘 절여진 배추는 여러 개의 양푼에 물을 담아 순서대로 흔들어 씻은 후 물기를 빼고 심을 잘라 정리한다.'),(332,62,3,'미지근한 물 1컵에 고춧가루를 넣고 잘 섞어 불린다.'),(333,62,4,'무, 배는 4~5cm 길이로 채썰고 미나리, 실파는 4cm 길이로 썬다. 굵은 파는 어슷썬다.'),(334,62,5,'깨끗이 씻어 껍질을 벗긴 마늘과 생강을 절구에 조금씩 넣어 가면서 곱게 찧는다.'),(335,62,6,'불린 고춧가루에 갖은 양념을 넣어 버무리고 준비한 채소를 전부 넣어 속을 만든다.'),(336,63,1,'열무와 무는 흐르는 물에 깨끗이 씻어 다듬어 4~5cm 길이로 썬다. 큰 그릇에 열무와 풋배추를 섞이지 않게 넣고 소금을 뿌려 1시간 정도 절인다.'),(337,63,2,'실파는 4cm 길이로 썰고 청고추는 어슷썰고 씨를 대충 털어낸다.'),(338,63,3,'냄비에 10컵의 물을 붓고 밀가루 2큰술을 넣어 중불에서 풀을 쑤어 식혀 놓는다.'),(339,63,4,'홍고추는 물에 불려 반으로 가르거나 어슷썰어 씨를 털어내고 분마기에 조금씩 넣어 방망이로 곱게 갈아 놓는다.'),(340,63,5,'식힌 밀가루풀에 분량의 물을 붓고 곱게 간 홍고추, 다진 마늘, 생강, 청고추를 넣는다.'),(341,63,6,'국물을 준비한 뒤 싱거우면 소금으로 간한다.'),(342,64,1,'오이는 굵은 소금으로 문질러 씻어 5cm 길이로 잘라 십자로 칼집을 넣는다.'),(343,64,2,'오이가 잠길 정도의 물에 굵은 소금을 풀어 소금물을 만들어 오이를 담가 30분 정도 절인 후 마른 행주로 물기를 닦는다.'),(344,64,3,'부추는 씻어 가지런히 잡고 잘게 송송 썬다.'),(345,64,4,'넓은 그릇에 분량의 고춧가루를 담고 물을 조금씩 부어가며 되직하게 개어 다진 파, 다진 마늘, 다진 생강과 송송 썬 부추를 넣고 소금과 설탕으로 간을 맞춰 버무린다.'),(346,64,5,'오이의 칼집이 벌어지게 한 후 ④의 소를 빠지지 않게 채운다.'),(347,64,6,'준비해둔 통에 오이를 길이대로 눕혀 차곡차곡 담고 남은 소를 위에 얹는다.'),(348,65,1,'무는 나박썰기하고 배추는 속대만 골라 무와 같은 크기로 썰고 따로 소금에 절인다. 30분 정도 절인 뒤 한 번 뒤집어 준다.'),(349,65,2,'미나리는 씻어 3cm 길이로 자르고 홍고추는 반으로 갈라 씨를 털고 채썬다.'),(350,65,3,'굵은 파, 생강, 마늘도 곱게 채썬다.'),(351,65,4,'큰 그릇에 물 20컵을 붓고 고춧가루 1/3컵을 거즈에 싸서 물에 담가 흔들어 고춧가루 물을 만든 뒤 소금간을 한다.'),(352,65,5,'절여진 배추와 무에 채썬 파, 마늘, 생강, 홍고추, 미나리를 섞어 고루 버무린다.'),(353,65,6,'잘 버무려진 나박김치를 항아리에 먼저 담고 삼삼하게 간을 한 김칫국을 부어 숙성시킨다.'),(354,66,1,'총각무는 무청이 파랗고 심이 없는 것으로 골라 잔뿌리는 떼고 무청이 달린 부분은 칼로 다듬어 씻어 건진 후 무가 크면 길게 2등분한다.'),(355,66,2,'큰 그릇에 총각무를 켜켜이 담아 소금물을 붓고 표면이 덮이도록 소금을 뿌려 3시간 정도 절인다.'),(356,66,3,'대파는 깨끗이 손질해 어슷썬다.'),(357,66,4,'물1컵에 찹쌀가루 3큰술을 풀어 거품기로 저어주면서 중간 불에서 찹쌀풀을 쑤어 식힌다.'),(358,66,5,'멸치젓을 냄비에 담고 센불에서 살이 빠지고 뼈만 남을 때까지 끓여 체에 밭쳐 국물을 거르고, 식힌 찹쌀풀에 고춧가루, 대파, 다진 마늘, 다진 생강, 멸치젓국, 새우젓, 설탕을 고루 넣어 양념을 만든다.'),(359,66,6,'절여둔 총각무에 양념을 넣어 잘 버무린 다음 2-3개씩 모아 하나로 묶어서 항아리에 차곡차곡 담아 익힌다.'),(360,67,1,'무는 깨끗이 씻어 물기를 닦고 1.5cm 두께로 토막내어 가로 세로 1.5cm크기로 고르게 깍뚝썬다.'),(361,67,2,'실파, 미나리, 갓은 다듬어 씻어 3~4cm 길이로 똑같이 맞추어 썬다.'),(362,67,3,'굴은 삼삼한 소금물에 담가 살살 흔들어 씻어 소쿠리에 건져 물기를 뺀다.'),(363,67,4,'새우젓은 잡티를 골라 새우젓 건더기만 건져내어 도마 위에 놓고 곱게 다져 놓는다.'),(364,67,5,'깍뚝썬 무는 우묵한 그릇에 담고 분량의 고춧가루를 넣어 고루 섞어 빨갛게 물들인다.'),(365,67,6,'깍두기에 고춧가루물이 골고루 들었을 때 소금을 고루 넣고 간이 배도록 살짝 버무린다.'),(366,68,1,'무는 적당히 작은 것으로 골라 수세미로 가볍게 문질러 씻어 잔털을 정리한다.'),(367,68,2,'넓은 그릇에 소금을 깔고 무를 그 위에 굴려 항아리에 담아 하룻밤 재운다.'),(368,68,3,'갓과 살파는 소금에 절여 헹구어 믈기를 뺀 후 실파는 3뿌리씩 갓은 1뿌리씩 묶는다.'),(369,68,4,'손질한 청고추는 항아리에 차곡차곡 담아 짭짤하게 소금물을 만들어 붓고 한달 정도 그늘에 두어 삭힌다.'),(370,68,5,'마늘과 생강은 얄팍하게 저며썬다.'),(371,68,6,'배는 씻어 껍질을 벗기지 말고 반으로 자른다. 깨끗한 주머니에 저며 썬 마늘과 생강, 굵은 파뿌리를 넣고 배를 넣어 잘 아물린다.'),(372,69,1,'갓은 겉잎을 잘라내고 큰 그릇에 물을 넉넉히 담고 흔들어 여러 번 헹구어 씻는다.'),(373,69,2,'갓을 가지런히 담고 소금을 골고루 뿌려 1시간 정도 절인 뒤 30분 정도 지나면 한번 뒤집는다.'),(374,69,3,'마지막 헹굴때 갓이 무르지 않도록 물에 소금을 조금 넣어 씻는다.'),(375,69,4,'무는 다듬어 가늘게 채썰어 그릇에 담고 소금을 뿌려 30분 정도 절였다가 물기를 꼭 짠다.'),(376,69,5,'멸치젓은 달이지 않고 국물만 체에 걸러 사용한다.'),(377,69,6,'물 1컵에 찹쌀가루 3큰술을 넣고 중불에서 눌지 않도록 저으면서 되직하게 찹쌀풀을 쑨다.'),(378,70,1,'꽃게는 솔로 문질러 씻어 등딱지를 떼고 모래주머니를 제거한다. 집게발은 떼서 끝을 다듬고, 몸통은 4토막으로 자른다.'),(379,70,2,' 애호박은 0.5cm 두께로 반달썰고, 무는 2cm x 2cm로 얇게 썬다.'),(380,70,3,'풋고추, 홍고추, 대파는 깨끗이 씻어 어슷썰고 느타리버섯은 흔들어 씻어 큰 것은 길이대로 적당히 찢어놓는다.'),(381,70,4,'냄비에 물 3컵을 붓고 체에 고추장을 걸러 푼 다음 썰어둔 무를 넣고 한소끔 끓인다.'),(382,70,5,'무가 어느 정도 익으면 준비한 꽃게, 느타리버섯, 고추, 다진 마늘, 생강을 넣고 끓이다가 애호박, 대파, 고춧가루를 넣고 끓인다.'),(383,70,6,'재료가 다 익어 맛이 어우러지면 위에 떠오르는 거품을 걷어내고 국간장, 소금, 후춧가루로 간을 맞춰 살짝 끓여 낸다.'),(384,71,1,'돼지등뼈는 큼직하게 토막내 하룻 밤 정도 찬물에 담갔다가 핏물이 빠지면 건진다.'),(385,71,2,'냄비에 물을 넉넉히 붓고 돼지등뼈를 넣어 끓이다가 도중에 물을 한 번 따라버리고 다시 물을 부어 끓인다.'),(386,71,3,'감자는 껍질을 벗긴 뒤 2등분하여 냉수에 담갔다가 건져 물기를 빼놓는다.'),(387,71,4,'굵은 파는 길이대로 길게 자르고 마늘, 생강은 곱게 다진다.'),(388,71,5,'냄비에 물을 넉넉히 붓고 손질해 놓은 감자를 넣어 삶는다. 너무 푹 익지 않았을 때 체에 밭쳐 건져낸다.'),(389,71,6,'청정원 맛선생을 비롯한 분량의 양념장을 넣어 양념을 준비한다.'),(390,72,1,'아구는 입끝에 독이 있으므로 입주위를 돌려가며 잘라내고 배를 갈라 내장을 뺀 다음 5cm 길이로 토막내어 열십자로 칼집을 넣는다.'),(391,72,2,'싱싱한 콩나물을 준비하여 머리와 뿌리를 제거해 준비하고, 미나리 줄기와 고사리는 콩나물과 같은 크기로 썬다.'),(392,72,3,'싸리버섯은 찢고 깻잎은 길게 2등분해 0.5cm로 채썬다.'),(393,72,4,'물 4컵에 된장 4큰술을 체에 내려서 풀고 물 6컵을 더 넣어 끓인 후 물이 끓어 오르면 손질한 아구, 콩나물, 고사리를 넣어 한소끔 더 끓인다.'),(394,72,5,'④가 끓으면 싸리버섯, 고추, 대파, 다진 마늘, 고춧가루, 후춧가루를 넣어 양념한 후 한소끔 더 끓인다.'),(395,72,6,'불에서 내리기 직전에 미나리와 깻잎을 넣어 살짝 끓여 낸다.'),(396,73,1,'조기는 내장과 지느러미를 떼어내고 비늘을 긁어 손질한 뒤 통째로 씻어서 3~4토막으로 자른다.'),(397,73,2,'무는 가로 세로 4cm로 나박썰고 양파는 굵게, 생강은 곱게 채썬다.'),(398,73,3,'굵은 파는 어슷썰고 마늘은 다진다.'),(399,73,4,'냄비에 물 4컵을 붓고 간장을 넣어 간한 뒤 고춧가루를 풀어 넣고 한소끔 끓인다.'),(400,73,5,'국물이 팔팔 끓으면 무와 손질한 조기를 넣어 중불에서 끓인다.'),(401,73,6,'조기가 어느정도 익으면 굵은 파와 채썬 양파, 다진 마늘, 생강을 넣고 잠깐 더 끓여 불에서 내린다.'),(402,74,1,'명란은 붉은 빛을 띠는 싱싱한 것으로 준비해 찬물에 살살 씻어 헹군 다음 체에 밭쳐 물기를 뺀다.'),(403,74,2,'쇠고기는 기름기 없는 연한 살코기만 골라 가늘게 채썬 후 간장, 다진 파, 다진 마늘, 참기름, 깨소금을 넣고 무친다.'),(404,74,3,'무는 2cm x 2cm 크기로 납작썰고 콩나물은 뿌리를 다듬어 씻고, 대파, 홍고추는 어슷썰며 쑥갓과 대파는 씻어 5cm 길이로 썬다.'),(405,74,4,'분량의 간장에 고춧가루, 다진 마늘, 생강즙, 청주, 소금, 후춧가루를 넣고 골고루 섞어 양념장을 만든다.'),(406,74,5,'뚝배기를 뜨겁게 달구어 밑간한 쇠고기와 납작썬 무를 넣고 볶다가 어느 정도 익으면 물 4컵을 붓고 양념장을 고루 풀어 넣는다.'),(407,74,6,'국물에 명란과 콩나물을 넣고 끓이다가 미나리, 쑥갓, 고추, 대파를 넣고 조금 더 끓여 향을 돋군다.'),(408,75,1,'우거지는 깨끗이 다듬어 끓는 물에 푹 삶은 뒤 찬물에 담가 냄새를 뺀다.'),(409,75,2,'쇠고기는 기름기가 많은 것으로 골라 먹기 좋은 크기로 얄팍하게 저며 썬다.'),(410,75,3,'청고추와 홍고추는 꼭지를 딴 뒤 송송 썰어 씨와 함께 다져놓는다. 파는 어슷썰고 마늘과 생강은 곱게 다진다.'),(411,75,4,'그릇에 물기를 뺀 ①을 넣고 된장 4큰술과 다진 마늘, 식용유 1큰술을 넣어 무친다.'),(412,75,5,'냄비에 기름을 두르고 쇠고기를 넣어 볶다가 무쳐놓은 우거지를 넣고 함께 볶은 후 쌀뜨물을 붓고 약불에서 은근히 끓인다.'),(413,75,6,'찌개가 끓으면 다진 청고추와 홍고추, 어슷썬 파를 넣고 간장으로 심심하게 간을 맞춘다.'),(414,76,1,'쇠고기는 샤브샤브용으로 얇게 썰은 것으로 준비하고 접시에 보기 좋게 펼쳐 담는다.'),(415,76,2,'배추는 속대로 준비하여 깨끗이 씻은 뒤 4cm 길이로 썬다. 당근과 무는 한 입 크기로 나박썰며 양파는 채썬다.'),(416,76,3,'곤약은 4cm 길이로 납작하게 썰고 어묵과 함께 끓는 물에 데쳐 준비한다.'),(417,76,4,'표고버섯은 갓의 중심에 칼집을 넣어 모양을 내고 느타리버섯은 모양대로 준비하며 팽이버섯은 밑둥을 잘라 준비한다.'),(418,76,5,'물에 씻어 물기를 뺀 쑥갓과 쇠고기, 배추, 표고버섯, 팽이버섯, 어묵, 곤약 등 준비한 재료를 큰 접시에 돌려 담는다.'),(419,76,6,'물 6컵에 다시마를 넣고 끓으면 다시마는 건져내고 청주, 소금을 넣어 간을 맞춘다.'),(420,77,1,'배추는 연한 잎으로 준비하여 큰 것은 반으로 갈라놓는다.'),(421,77,2,'애호박은 0.3cm 두께로 반달썰고 양파는 채썰며 대파는 어슷썬다.'),(422,77,3,'느타리버섯은 찬물에 흔들어 씻어 반으로 찢은 다음 물기를 빼둔다.'),(423,77,4,'쇠고기는 양지를 덩어리째 준비하여 물 4컵을 부어 푹 삶은 다음 얇게 썰어 국물은 기름을 걷어내고 육수로 쓴다.'),(424,77,5,'국수는 냄비에 물을 반쯤 부어 소금을 넣고 삶는다. 국수가 끓어오르면 찬물 1컵을 붓고 다시 끓으면 찬물에 헹군 뒤 체에 건져 물기를 뺀다.'),(425,77,6,'고춧가루에 진간장, 다진 마늘, 후춧가루를 분량대로 넣고 고루 섞은 다음 기름 두른 프라이팬에 넣고 살짝 볶는다.'),(426,78,1,'낙지는 내장을 떼고 소금으로 문질러 씻은 다음 5cm 길이로 자르고 머리도 같은 크기로 자른다.'),(427,78,2,'손질한 낙지를 간장 1큰술에 다진 파와 마늘을 넣고 양념한 뒤 10분 정도 재워둔다.'),(428,78,3,'새우는 소금물에 씻어 등쪽 두번째 마디를 꼬치로 찔러 내장을 빼고 껍질을 벗긴다.'),(429,78,4,'실파는 5cm 길이로 썰고 표고버섯도 5cm 길이로 채썬다. 홍고추는 씨를 털고 반으로 갈라  길이대로 채썰고 쑥갓은 씻어 5cm로 자른다.'),(430,78,5,'쇠고기 50g은 채썰고 30g은 다져서 각각 양념한다. 두부는 씻어 으깬 다음 물기를 꼭 짜서 소금, 참기름, 깨소금으로 양념한다.'),(431,78,6,'양념한 두부와 다진 쇠고기를 섞어 완자로 빚은 다음 밀가루와 계란을 입혀 프라이팬에 굴려 익힌다.'),(432,79,1,'찬물에 핏물을 뺀 선지를 소금을 조금 넣은 끓는 물에 덩어리째 넣고 살짝 데쳐 숟가락으로 뚝뚝 떼 놓는다. 우거지는 끓는물에 데친 후 5cm 길이로 썬다.'),(433,79,2,'콩나물은 뿌리를 다듬어 씻은 다음 살짝 삶아내고 물기를 빼놓는다.'),(434,79,3,'분량의 진간장에 다진 파, 마늘, 고춧가루, 참기름, 깨소금을 넣어 고루 섞어 양념장을 만든다.'),(435,79,4,'준비한 우거지, 콩나물은 그릇에 한데 담고 고추장과 다진 파, 마늘을 넣어 간이 배도록 조물조물 무친다.'),(436,79,5,'된장을 걸러 한소끔 끓인 국물에 양념한 우거지, 콩나물을 넣고 다시 팔팔 끓인다.'),(437,79,6,'우거지와 콩나물이 어느정도 물러져 맛이 우러나면 데쳐 놓은 선지를 넣고 양념장으로 알맞게 간을 맞춘 다음 한소끔 끓인다. 떠오르는 거품을 걷어내고 뜨겁게 끓여 상에 낸다.'),(438,80,1,'뚝배기에 한 사람이 먹을 만큼의 밥을 담고 콩나물은 씻어 삶아 밥이 덮일 만큼 수북이 얹는다.'),(439,80,2,'①위에 어슷썬 실파와 청고추, 결대로 찢은 장조림을 보기 좋게 둘러 얹고, 그 위에 잘게 썬 김치와 다진 마늘을 얹는다.'),(440,80,3,'재료를 넣은 뚝배기에 육수를 자작하게 부어 보글보글 끓이다가 상에 내기 직전에 살짝 구운 김을 비벼 얹고 생계란을 깨뜨려 얹은 다음 깨소금을 뿌린다.'),(441,80,4,'새우젓을 따로 곁들여 식성대로 간을 맞춰 먹는다.'),(442,81,1,'양은 속껍질이 나오도록 말끔히 벗겨 흐르는 물에 헹군 뒤 큰 그릇에 담아 소금으로 벅벅 문질러 씻은 후 다시 헹궈낸다.'),(443,81,2,'무는 큼직하게 토막 낸다. 대파 1/2뿌리는 송송 썰고 남은 1/2뿌리는 길고 큼직하게 썰어 놓는다. 마늘은 통째로 준비한다.'),(444,81,3,'손질한 양을 냄비에 넣고 물을 충분히 부은 후 길게 썬 파와 통마늘을 넣고 뚜껑을 연채 푹 익도록 끓인다. 20분쯤 끓어 양이 익으면 양지머리를 넣고 덩어리째 한참 끓인다.'),(445,81,4,'양과 양지머리가 익으면 토막 낸 무를 넣어 무가 속까지 익을 때까지 푹 끓인다.'),(446,81,5,'익은 고기와 무를 건진다. 무와 양지머리는 납작하게 썰고, 양은 어슷하게 썬다.'),(447,81,6,'분량의 양념 재료로 양념을 만든다. 그릇에 양과 양지머리를 함께 넣고 양념한다. 무는 부서지기 쉬우므로 따로 양념한다.'),(448,82,1,'토막낸 쇠뼈와 사골은 찬물에 1-2시간 담가서 핏물을 빼고 도가니와 양지머리는 덩어리째 씻어놓는다.'),(449,82,2,'큰 솥에 쇠뼈와 사골을 넣고 물을 넉넉히 부어 센불에서 끓이다가 국물에 검은색이 돌고 거품이 나면 검은 물을 따라 버리고 다시 물 20컵을 부어 끓인다.'),(450,82,3,'끓는 사골국물에 도가니와 양지머리를 덩어리째 넣고 파1뿌리와 통마늘1통을 넣어 뚜껑을 연 채 끓인다. 팔팔 끓어오르면 불을 줄이고 뭉근히 푹 끓인다.'),(451,82,4,'도가니가 푹 물러지면 건져 내 작은 토막으로 썰고 양지머리는 저며썰어 놓는다.'),(452,82,5,'끓는 물에 국수를 삶아 찬물에 행군 다음 체에 건져 놓는다.'),(453,82,6,'물기빠진 국수를 끓는 국에 담가 따뜻하게 데운 다음 뚝배기에 담고 그 위에 고기를 얹어 국물을 붓는다. 상에 낼 때는 소금과 후추가루, 송송 썬 파를 그릇에 담아낸다.'),(454,83,1,'도가니는 적당히 토막 내어 찬물에 담가 핏물을 뺀다. 사태는 기름기 없는 것으로 골라 덩어리째 준비한다.'),(455,83,2,'냄비에 물 20컵을 붓고 사태를 넣어 끓이다가 붉은 색이 없어지면 도가니를 넣어 센 불에서 끓인다.'),(456,83,3,'끓이다가 국물이 우러나오면 고기를 건져서 한입 크기로 썰고, 남은 뼈는 다시 국물에 넣고 2시간 동안 푹 고아낸다.'),(457,83,4,'썰어 놓은 고기에 다진 마늘 2큰술 반과 분량의 생강, 소금, 후춧가루를 넣어 양념하고 국물은 위에 한지를 덮어 스며들게 한다.'),(458,83,5,'건지를 그릇에 담고 송송 썬 파를 얹은 다음 국물을 끓여 붓는다.'),(459,83,6,'진간장에 다진 마늘 반 큰술, 생강, 고춧가루, 참기름, 후춧가루를 넣고 양념장을 만들어 종지에 담아내어 곁들인다.'),(460,84,1,'쇠꼬리는 4cm로 토막 낸 후 찬물에 담가 핏물을 뺀다. 찬물을 두세 번 갈아서 깨끗이 헹구어 건져놓는다.'),(461,84,2,'무는 3cm 길이로 토막 내고, 파 1뿌리는 송송 썰고 1뿌리는 5cm 길이로 썬다. 당면은 찬물에 불렸다가 끓는 물에 데친 후 체에 밭쳐 찬물에 헹군다.'),(462,84,3,'냄비에 물을 팔팔 끓여 핏물을 뺀 쇠꼬리를 넣고 데친 다음, 첫물은 따라내고 다시 찬물을 20컵 부어 무와 크게 썬 파, 통마늘을 넣고 국물이 뽀얗게 우러나도록 중불에서 1시간 이상 끓인다.'),(463,84,4,'국물이 우러나면 쇠꼬리를 건져 한 입 크기로 썬 다음 분량의 양념 재료로 양념한다. 무도 건져내어 식혀서 얄팍하게 나박썰고 따로 양념한다. 국물은 거즈에 걸러낸다.'),(464,84,5,'거즈에 밭친 국물을 냄비에 담고 양념한 쇠꼬리와 무를 넣어 한소끔 더 끓인다.'),(465,84,6,'국물이 끓으면 준비한 당면과 송송 썬 파를 넣고 소금으로 간 한 뒤 살짝 끓여 상에 낸다.'),(466,85,1,'갈비는 찬물에 담가 핏물을 뺀 뒤 냄비에 넣고 물 10컵을 부어 푹 끓인다.'),(467,85,2,'무는 3cm 두께로 토막 내어 갈비와 같이 끓여 푹 익힌다.'),(468,85,3,'무와 갈비가 푹 익으면 건져 내어 거즈나 종이로 기름을 걸러낸다.'),(469,85,4,'삶아낸 갈비와 무를 그릇에 담고 국간장, 다진 파, 다진 마늘, 참기름, 후춧가루로 고루 무쳐낸다.'),(470,85,5,'기름을 걷어낸 국물에 양념한 갈비와 무를 넣고 국간장으로 부족한 간을 한 다음 한소끔 더 끓여 낸다.'),(471,85,6,'그릇에 낼 때는 계란 지단을 곁들인다.'),(472,86,1,'부추는 잎이 짧고 통통한 것으로 골라 가지런히 다듬어 흐르는 물에 씻은 후, 물기를 빼고 반으로 자른다.'),(473,86,2,'멸치젓에 1/2컵의 물을 부어 끓인 후 고운체에 걸러 맑은 젓국을 만든다.'),(474,86,3,'마늘과 생강은 곱게 다지고 홍고추는 가늘게 채썬다.'),(475,86,4,'부추를 그릇에 펴 담고, 멸치젓을 고루 뿌려 절인다.'),(476,86,5,'부추가 절여지면 멸치젓국을 따라내고, 고춧가루와 마늘, 생강, 홍고추, 설탕을 섞어 양념을 만들어 부추를 버무린다.'),(477,86,6,'부족한 간은 소금으로 한 후 완성한다.'),(478,87,1,'실파는 뿌리를 잘라내고 다듬어 물기를 뺀다.'),(479,87,2,'넓은 그릇에 실파를 고르게 펴고 까나리액젓을 뿌려 절인다.'),(480,87,3,'고춧가루에 약간의 물을 부어 불린 후 다진 마늘, 다진 생강, 설탕, 소금, 깨소금을 넣어 고루 섞어 양념장을 만든다.'),(481,87,4,'절인 실파에 양념장을 넣어 고루 버무린다.'),(482,87,5,'버무린 실파는 다섯 뿌리씩 모아 잡고 한 데 묶어 항아리에 담는다.'),(483,88,1,'배추는 2~4등분하여 소금물에 절인 후 물로 헹구어 물기를 뺀다.'),(484,88,2,'무는 다듬어 0.3cm 굵기로 채썬다. 밤과 배는 손질하여 가늘게 채썰고 대추는 잘 닦아 씨를 뺀 후 채썬다.'),(485,88,3,'표고버섯은 물에 불린 후 기둥을 떼고 채썬다. 생강은 손질하여 채썰고 미나리는 3cm로 자르고 대파는 흰 부분만 3cm 길이로 잘라 채썬다.'),(486,88,4,'무, 밤, 미나리, 대파와 다진 마늘, 생강을 섞고 실고추를 넣어 버무린 후 대추, 표고버섯, 잣, 채썬 석이버섯을 넣고 소금으로 간한다.'),(487,88,5,'절인 배추에 준비한 소를 배춧잎 사이 사이에 넣고 겉에 있는 큰 잎으로 흐트러지지 않게 잘 싸서 항아리에 눌러 담는다.'),(488,88,6,'껍질을 벗긴 배 2개를 강판에 갈아 즙을 낸 뒤 소금물과 함께 섞어 항아리에 붓는다.'),(489,89,1,'깻잎은 싱싱한 것으로 골라 씻어낸 후 물기를 완전히 뺀다.'),(490,89,2,'파는 잘게 썰고 마늘과 생강은 곱게 다진다.'),(491,89,3,'진간장에 ②와 고춧가루를 넣어 양념장을 만든다.'),(492,89,4,'깻잎을 한 장씩 펴서 양념장을 바른다.'),(493,89,5,'준비한 항아리에 깻잎을 차곡차곡 담고 누르개로 누른 후 남은 양념장을 붓는다.'),(494,89,6,'2~3일 후에 진간장만 따라내어 팔팔 끓인 다음 식혀 항아리에 다시 붓는다. 약 1주일이 지나면 깻잎이 누렇게 익는다.'),(495,90,1,'오이는 잘고 연한 재래종으로 준비하여 씻은 후, 물기를 뺀다.'),(496,90,2,'소금물을 팔팔 끓여 놓은 후 식혀 놓는다. 오이에 식힌 소금물을 붓고 무거운 돌로 눌러 놓는다.'),(497,90,3,'1주일 정도 지나면 소금물을 따라내어 다시 한 번 끓여 식힌 다음 오이에 붓는다.'),(498,90,4,'2주일 정도 지나면 절여진 오이를 꺼내어 소쿠리에 넣어 말린 다음 고추장에 버무려 항아리에 담아 5~6개월 정도 익힌다.'),(499,90,5,'먹을 때마다 조금씩 꺼내어 고추장을 훑어내고 송송 썬다.'),(500,90,6,'다진 마늘과 고춧가루, 참기름, 설탕을 함께 섞어 양념을 만든다.'),(501,91,1,'콩은 주로 검은 것으로 하나, 얼룩이 있는 밤콩이나 푸른콩을 사용해도 된다. 콩은 물에 담가 충분히 불린다.'),(502,91,2,'냄비에 불린 콩을 넣고 간장과 물 1컵을 부어 중간 불에서 조린다.'),(503,91,3,'조리면서 고루 익도록 자주 뒤적여준다.'),(504,91,4,'콩이 익어 쪼글쪼글해지고 국물이 졸아들면 불을 줄이고 설탕을 넣고 잘 섞어준다.'),(505,91,5,'약한 불에서 계속 조려 국물이 거의 졸아들고 콩에윤기가 돌면 불에서 내려 참기름, 깨소금을 뿌려 낸다.'),(506,92,1,'쇠고기는 큼직하게 토막 낸 후 기름기와 힘줄을 없앤다.'),(507,92,2,'마늘은 통으로 준비하고 생강은 얇게 저민다. 홍는 어슷하게 썰어 씨를 털어낸다.'),(508,92,3,'계란은 삶아 찬물에 담갔다가 껍질을 벗긴다. 당근은 손질하여 도톰하게 반달모양으로 썰어낸다.'),(509,92,4,'냄비에 쇠고기와 마늘, 생강을 넣고 잠길 정도로 물을 부어 끓이다가 불을 줄여 익힌다.'),(510,92,5,'국물의 1/3쯤 졸면 진간장과 설탕을 넣고 약한 불에서 계속 졸이다가 조림간장이 반으로 줄면 준비한 계란, 당근, 홍고추를 넣는다.'),(511,92,6,'계란은 주걱으로 굴려가며 간이 고루 배게 한다. 상에 낼 때는 깨소금을 뿌린다.'),(512,93,1,'연근은 씻어 위 아래는 잘라내고 껍질을 두껍게 벗겨내 5cm 두께로 통썰기한다.'),(513,93,2,'그릇에 진간장, 설탕, 청주와 물 5큰술을 넣고 잘 섞어 조림장을 만든다.'),(514,93,3,'프라이팬에 기름을 두르고 연근을 살짝 볶는다.'),(515,93,4,'볶은 연근에 조림장을 붓고 뚜껑을 덮어 약한 불에서 은근하게 조려낸다.'),(516,93,5,'연근이 윤기나게 조려지면 불에서 내리고 통깨를 뿌려 마무리한다.'),(517,94,1,'실파는 깨끗이 손질한 후 가지런히 모아잡고 길이로 반을 자른다. 뿌리는 칼등으로 두드린다.'),(518,94,2,'굴과 홍합, 조갯살은 연한 소금물에 씻어 물기를 뺀 후 굵게 다진다.'),(519,94,3,'멥쌀은 불려서 물1컵을 붓고 곱게 갈아 밀가루와 물1컵을 부어 훌훌하게 반죽하고 소금으로 간한다.'),(520,94,4,'실파는 한줌씩 쥐어 반죽에 담갔다가 기름두른 팬에 가지런히 놓는다.'),(521,94,5,'그 위에 해물을 펴서 고루 얹는다.'),(522,94,6,'밑이 노릇하게 되면 푼 달걀을 위에 끼얹은 후 뒤집는다.'),(523,95,1,'오이는 가는 것으로 골라 소금으로 문질러 씻고 0.3cm 두께로 얄팍하게 썬다.'),(524,95,2,'파와 마늘은 곱게 다지고 실고추는 3cm 길이로 짧게 끊어놓는다.'),(525,95,3,'오이는 소금 2작은술로 절였다가 물에 살짝 헹구어 꼭 짠다.'),(526,95,4,'팬을 달구어 참기름을 두르고 절인 오이를 넣어 볶아 낸다.'),(527,95,5,'기름이 돌면 다진 파, 마늘, 깨소금, 실고추를 넣고 잠깐 볶아서 넓은 그릇에 펼쳐 식힌다.'),(528,96,1,'냉이는 소금을 넣은 끓는 물에 살짝 데친 후 마늘 3쪽 다진 것과 된장을 넣어 손으로 무쳐 낸다.'),(529,96,2,'모시조개는 하룻밤정도 물에 담가두어 해감을 토하게 한다.'),(530,96,3,'냄비에 물 10컵과 모시조개를 넣고 끓이다가 모시조개의 입이 벌어지면 건져내고 국물을 거즈에 걸러 냄비에 담고 된장에 무친 냉이를 넣고 푹 끓인다.'),(531,96,4,'찌개가 끓기 시작하면 파와 마늘을 어슷하게 썰어 넣고 간을 맞춘 뒤 마지막으로 모시조개를 넣는다.'),(532,97,1,'계란을 그릇에 깨뜨려 넣고, 분량의 소금과 후추를 넣어 젓가락으로 섞는다.'),(533,97,2,'물 1컵과 다시마 끓인 국물을 걸러내고 차게 식힌다. ①의 계란에 붓고 거품기로 고루 섞는다. 다진 파와 다진 마늘을 넣고 더 섞는다.'),(534,97,3,'사각 팬에 기름을 두르고 달구어지면 계란물을 2/3정도 붓고 젓가락으로 저어 꾸덕꾸덕해지면 도톰하게 만든다.'),(535,97,4,'다시 팬에 기름을 두르고 나머지 계란물을 부어 완전히 익기 직전에 접는다.'),(536,97,5,'김발에 싸서 두었다가 완전히 식으면 도톰하게 썬다.'),(537,98,1,'닭은 먹기 좋게 토막 내어 진간장, 다진 마늘, 후춧가루로 밑간을 해 놓는다.'),(538,98,2,'간이 밴 닭고기에 녹말가루를 묻혀 180°C 의 기름에 노릇하게 튀겨 낸다.'),(539,98,3,'냄비에 분량의 양념 재료를 넣고 물 2큰술을 부어 끓이다가 튀긴 닭을 넣고 윤기 나게 바짝 조린다. 도중에 조림장을 끼얹어 속까지 간이 배게 한다.'),(540,98,4,'닭강정을 접시에 담고 통깨를 뿌린다.'),(541,99,1,'배추는 한 잎 씩 떼어 씻은 다음 소금 5 큰술을 고루 뿌려 절여놓는다.'),(542,99,2,'새우젓은 건더기만 곱게 다진다.'),(543,99,3,'절인 배추는 찬물에 헹구었다가 소쿠리에 건져 물기를 뺀 다음 손으로 쭉쭉 찢는다.'),(544,99,4,'다진 파와 마늘, 생강, 고춧가루, 진간장, 새우젓, 설탕, 참기름을 섞어 양념을 만든다.'),(545,99,5,'찢은 배추를 양념으로 버무린다. 상에 낼 때 통깨로 마무리한다.'),(546,100,1,'더덕은 껍질을 벗긴 뒤 적당한 길이로 쪼개어 밀대나 칼등으로 두드린다.'),(547,100,2,'다듬은 더덕은 물에 담가 아린맛을 뺀 후 건져서 물기를 닦아내고 참기름과 간장을 넣어 주무른다.'),(548,100,3,'고추장 2큰술에 양념재료를 모두 넣고 고루 섞어 놓는다.'),(549,100,4,'달군 석쇠에 ②의 더덕을 가지런히 올리고 타지 않게 살짝 구워낸다.'),(550,100,5,'양념장을 발라 다시 한번 구워낸다.'),(551,101,1,'감자는 껍질을 벗겨 한 입 크기로 토막낸다.'),(552,101,2,'토막낸 감자는 모서리를 다듬은 후 찬물에 담가 끈끈한 성분이 없어지면 물기를 닦는다.'),(553,101,3,'멸치는 조림용으로 준비해 머리와 지저분한 것을 떼어낸다.'),(554,101,4,'냄비에 기름을 둘러 감자를 볶다가 물을 자작하게 붓고 분량의 진간장과 물엿, 청주를 넣어 끓인다.'),(555,101,5,'조림장이 어느 정도 졸아들면 멸치를 넣고 간이 배게 더 조린다.'),(556,101,6,'조림재료에 윤기가 돌면 깨소금을 넣어 살짝 버무린다.'),(557,102,1,'마른 오징어는 물에 불려 깨끗이 씻은 다음 껍질을 벗긴다.'),(558,102,2,'껍질 벗긴 오징어는 길이로 반 갈라 1cm 폭으로 썬다.'),(559,102,3,'오징어를 냄비에 넣고 참기름과 물을 부어 천천히 조린다.'),(560,102,4,'국물이 1/3 정도로 졸아들면 진간장, 설탕을 넣고 다진 파와 다진 마늘을 넣는다.'),(561,102,5,'약한 불에서 은근히 조리다가 국물이 거의 졸면 꼭지 딴 청고추를 넣고 살짝 버무린다.'),(562,102,6,'윤기나게 조려지면 깨소금과 후춧가루를 뿌려 마무리한다.'),(563,103,1,'죽순은 삶아서 딱딱한 바깥쪽을 벗겨 내고 4cm 크기로 썬다.'),(564,103,2,'쇠고기는 채썰어 술, 간장 1/2 작은술을 뿌려 간한다.'),(565,103,3,'고기에 간이 배면 녹말가루를 뿌려 버무린 뒤 달군 냄비에 넣고 살짝 볶는다.'),(566,103,4,'고기를 꺼내고 죽순, 데친 마늘종을 볶다가 양념한다.'),(567,103,5,'맛이 배면 고기를 다시 넣고 볶다가 참기름을 넣고 고루 뒤적인 다음 불을 끈다'),(568,104,1,'애호박은 두께가 고른 것으로 골라 깨끗이 씻은 다음 0.5cm 두께로 통썬다.'),(569,104,2,'호박에 소금을 뿌려 살짝 절였다가 거즈로 물기를 닦아낸다.'),(570,104,3,'계란은 풀어 소금으로 간을 해 놓는다.'),(571,104,4,'준비한 호박의 앞뒤로 밀가루를 고루 묻힌 다음 계란물에 적신다.'),(572,104,5,'달구어진 프라이팬에 기름을 둘러 중간불에서 노릇하게 지진다.'),(573,104,6,'분량의 양념 재료를 섞어 양념장을 만들어 곁들인다.'),(574,105,1,'돼지고기는 한 입 크기로 썰어 간장과 설탕으로 밑간한다.'),(575,105,2,'표고버섯과 피망, 당근도 고기와 같은 크기로 썬다.'),(576,105,3,'분량의 간장, 설탕, 식초, 물은 한 볼에 섞어 준비해둔다.'),(577,105,4,'①에 계란흰자를 넣고 버무린 뒤 녹말가루를 묻혀 바삭하게 튀긴다.'),(578,105,5,'프라이팬에 준비한 야채를 넣고 볶다가 섞어둔 소스 재료를 넣고 끓여 걸쭉해지면 튀긴 돼지고기를 넣고 맛이 고루 배도록 버무려 낸다.'),(579,106,1,'메주콩은 5배의 물을 붓고 반나절 정도 담가 불린다.'),(580,106,2,'콩이 완전히 불면 냄비에 ①을 넣고 물을 콩 위로 1cm 정도 올라오게 부어 삶는다.'),(581,106,3,'②가 한번 우르르 끓으면 불을 끄고 뜸을 들인다. (콩을 오래 삶으면 냄새가 나므로 살짝 삶는 것이 포인트!)'),(582,106,4,'체로 콩을 건진 후 찬물을 부어 양손으로 비벼가며 껍질을 벗기고 콩만 건진다.'),(583,106,5,'믹서에 삶은 콩, 통깨, 잣을 넣고 생수를 부어 곱게 간 뒤, 체에 밭쳐 건더기는 걸러내고 국물만 받아 냉장고에 차게 둔다.'),(584,106,6,'볼에 계란과 소금을 적당량 넣고 잘 풀어준 뒤 체에 한번 걸러준다.'),(585,107,1,'쇠고기는 연한 부위로 준비해 0.5cm 두께로 도톰하게 저며 앞 뒤로 잔칼집을 넣는다.'),(586,107,2,'진간장에 배즙을 넣고 나머지 양념 재료를 모두 합해 양념장을 만든다.'),(587,107,3,'고기를 굽기 30분전에 ②의 양념장을 고루 묻혀 간이 배게 한다.'),(588,107,4,'뜨겁게 달군 석쇠에 올려 앞뒤로 익힌다.'),(589,108,1,'부추는 싱싱한 것으로 골라 흐르는 물에 씻어 4cm 길이로 자른다.'),(590,108,2,'고추는 송송 썰어 씨를 털어낸다.'),(591,108,3,'그릇에 밀가루를 담고 소금으로 간을 한 뒤 계란과 물을 부어 멍울이 없도록 잘 풀어주고, 썰어 놓은 부추를 넣어 반죽을 한다.'),(592,108,4,'달군 프라이팬에 기름을 두르고 ③의 반죽을 한 국자씩 얹고 위에 청고추와 홍고추를 얹어 지진다.'),(593,108,5,'한 면이 노릇하게 익으면 뒤집어 마저 익힌 다음 먹기 좋은 크기로 썰어 낸다.'),(594,109,1,'돼지갈비는 먹기 좋게 토막 내 기름을 떼어내고 병풍모양으로 포를 떠서 잔칼집을 넣는다.'),(595,109,2,'손질한 갈비에 생강즙과 술을 뿌려 놓는다.'),(596,109,3,'진간장 5큰술에 나머지 양념 재료를 합해 양념장을 만든다.'),(597,109,4,'②의 고기에 ③의 양념장을 넣고 버무려 재워둔다.'),(598,109,5,'간이 충분히 배면 팬에 기름을 두르고 지지거나 석쇠에 얹어 속까지 잘 익도록 굽는다.'),(599,109,6,'구운 돼지갈비와 깨소금, 상추, 깻잎을 함께 곁들여 낸다.'),(600,110,1,'불린 쌀에 물을 붓고 다시마를 얹어 고슬고슬하게 밥을 짓는다.'),(601,110,2,'밥이 다 되면 다시마를 꺼내고 촛물과 섞어 비빈다.'),(602,110,3,'참치는 너비 3cm 정도로 썰고 오징어는 참치와 같은 크기로 썬다.'),(603,110,4,'문어는 데쳐서 0.5cm 두께로 썰고 새우는 데쳐 몸통 가운데에 칼집을 넣어 넓적하게 편다.'),(604,110,5,'초밥을 뭉쳐 고추냉이를 바르고 준비한 생선을 붙여서 낸다.'),(605,111,1,'꽁치통조림을 체에 쏟아 국물은 따로 받아놓는다.'),(606,111,2,'무는 3cm 길이로 토막낸 후 반으로 갈라 도톰하게 썬다.'),(607,111,3,'①의 꽁치국물에 양념을 분량대로 섞어 양념장을 만든다.'),(608,111,4,'깊이가 얕은 냄비에 무를 깔고 꽁치를 가지런히 놓은 다음 양념장을 고루 끼얹어 불에 올린다.'),(609,111,5,'뚜껑을 열어 놓은 채로 가끔 조림국물을 끼얹으면서 무가 무르게 익을 때까지 조린다.'),(610,112,1,'김치는 소를 털어내고 줄기만 길이 8cm, 너비 2cm로 썰어 참기름을 고루 묻힌다.'),(611,112,2,'쇠고기는 도톰하게 포를 떠 잔칼질하여 김치보다 약간 길게 썬다.'),(612,112,3,'표고버섯은 1cm 폭으로 썰고 도라지는 삶아서 반으로 갈라 참기름과 소금으로 무친다.'),(613,112,4,'준비된 재료를 꼬치에 꽂아 밀가루를 묻힌 후 계란물을 묻혀 기름에 지진다.'),(614,113,1,'낙지는 소금으로 문질러 씻은 후 끓는 물에 살짝 데친다.'),(615,113,2,'양파와 고추는 굵게 채썰고 대파는 4cm 길이로 썬다.'),(616,113,3,'분량의 양념 재료를 섞어 양념장을 만든다.'),(617,113,4,'데친 낙지에 ③을 넣고 고루 섞어 버무린다.'),(618,113,5,'달군 프라이팬에 야채와 낙지를 넣고 센불에서 재빨리 볶는다.'),(619,113,6,'마지막으로 참기름과 깨소금을 뿌려 마무리한다.'),(620,114,1,'두부는 팔팔 끓는물에 소금을 약간 넣고 속까지 따뜻하게 익도록 데쳐낸다.'),(621,114,2,'배추김치는 소를 대강 털고 1cm 폭으로 송송 썬 다음 다진 마늘과 참기름으로 무쳐놓는다.'),(622,114,3,'양념한 김치를 팬에 넣고 숨이 죽도록 볶는다.'),(623,114,4,'찬물에 담가둔 깻잎은 담궈 곱게 채를 썬다.'),(624,114,5,'두부를 먹기 좋게 썬 다음 깻잎과 볶은 김치를 접시에 담아 낸다.'),(625,115,1,'계란은 1인분에 2개씩해서 1인분씩 만든다. 계란을 잘 풀어서 소금 1/6작은술과 후춧가루를 잘 섞은 후 우유 1큰술을 넣고 잘 섞어준다.'),(626,115,2,'달군 팬에 식용유를 두르고 ①을 한번에 부어 젓가락으로 재빨리 휘저으면서 넓게 부친다. 안쪽은 반숙상태가 되도록한다.'),(627,115,3,'반숙이 되면 불을 약하게 하고 뒤집개로 계란을 먼 쪽에서 가까운 쪽으로 겹치며 모양을 만든다. 이때 버터 1/2큰술을 넣고 반달모양에서 배모양으로 만들고 뒤집어서 노릇하게 부쳐낸다. 기호에 따라 토마토케첩을 살짝 뿌린다.'),(628,116,1,'양배추는 밑동을 도려내고 끓는 물을 부어 살짝 데친다. 데치는 동안 한번 뒤집어주고 끓으면 뒤집어서 건져낸다.'),(629,116,2,'양배추를 찬물에 헹구고 잎 4장을 잘 벗겨낸다.'),(630,116,3,'다진고기에 계란, 후춧가루, 넛맥,빵가루를 섞고 곱게 다진 양파와 당근을 넣어 섞는다. 끈기가 나도록 잘 이겨 4등분한다.'),(631,116,4,'양배추잎은 심결대로 펴고 소를 뭉쳐 앞쪽에 둔다. 돌돌 말아 소를 싸고 이쑤시개로 꽂아 고정시켜 놓는다.'),(632,116,5,'냄비에 양배추말이를 넣고 수프를 가득부어 소근, 후추, 간장을 약간씩 넣고 냄비보다 작은 기름종이를 얹은 다음 뚜껑을 닫아 중불에서 약불로 조절해가며 20분정도 끓인다.'),(633,116,6,'다 익으면 건져내 이쑤시개를 빼고 2등분하여 접시에 담아낸다.'),(634,117,1,'두부는 6등분하여 끓는 물에 살짝 데친 뒤 물기를 제거하여 냉장고에 넣어 차게 식힌다.'),(635,117,2,'미역은 충분히 불려 다져 놓는다.'),(636,117,3,'양파는 곱게 다져서 물에 씻어 매운기를 뺀뒤 물기를 꼭 짠다.'),(637,117,4,'홍고추는 곱게 다지고 분량의 양념 재료를 섞어 소스를 만들어둔다.'),(638,117,5,'차게 해놓은 두부는 접시에 보기좋게 담는다.'),(639,117,6,'두부 위에 다진 미역을 얹고, 그 위에 다진 양파와 홍고추를 얹고 소스를 끼얹어 낸다.'),(640,118,1,'계란은 풀어서 소금으로 간을 맞춘다.'),(641,118,2,'돼지고기와 당근, 양파는 0.7cm 크기로 썬다.'),(642,118,3,'말린 표고 버섯은 미지근한 물에 불려 기둥을 떼어내고 0.7cm 크기로 썬다.'),(643,118,4,'대파는 굵게 다진다.'),(644,118,5,'식용유를 넉넉히 두른 프라이팬에 계란을 넣어 젓가락으로 휘저어 익힌 뒤 꺼낸다.'),(645,118,6,'식용유를 두른 프라이팬에 돼지고기를 넣어 볶다가 당근, 양파, 표고버섯을 넣어 볶는다.'),(646,119,1,'배추김치는 속을 털어 1cm 폭으로 송송 썰고 표고버섯은 미지근한 물에 불린 후 가늘게 채썬다.'),(647,119,2,'콩나물은 깨끗이 씻어 건지고, 당근은 껍질을 벗겨 가늘게 채썰고 대파, 홍고추, 청고추는 어슷썬다.'),(648,119,3,'햄은 5cm 길이로 가늘게 채썰고, 게맛살은 5cm 길이로 잘라 손으로 가늘게 찢는다.'),(649,119,4,'끓는 물에 라면과 당근, 콩나물을 넣고 뚜껑을 덮어 끓이다 한소끔 끓으면 라면수프와 고춧가루를 풀고 햄, 게맛살, 파, 고추, 다진 마늘을 넣고 뜸들인다.'),(650,119,5,'재료가 다 익으면 그릇에 담아 낸다.'),(651,120,1,'계란은 소금으로 간하여 지름 12cm 정도로 얇게 지단을 부친다.'),(652,120,2,'미나리는 살짝 데쳐서 물기를 꼭 짜고 치커리는 4cm 길이로 썰어둔다.'),(653,120,3,'새우는 껍질과 내장을 제거한 뒤 끓는 물에 데치고, 맛살은 5cm 길이로 잘라 잘게 찢어 물에 담갔다 건져 물기를 제거한다.'),(654,120,4,'국수는 삶아서 헹군 뒤 사리를 지어 소쿠리에 밭쳐놓는다.'),(655,120,5,'계란 지단을 펴서 치커리, 국수, 게맛살을 놓고 말아 미나리로 묶어주고 위에 새우를 얹는다.'),(656,120,6,'분량의 양념 재료를 섞어 간장소스를 만들어 곁들여 낸다.'),(657,121,1,'꽁치는 머리와 꼬리를 떼어내고 두 토막내어 내장을 뺀 뒤 소금을 뿌려놓는다.'),(658,121,2,'실파는 송송 썬다.'),(659,121,3,'조림장은 은근한 불에서 걸쭉하게 조린다.'),(660,121,4,'꽁치는 물기를 빼고 석쇠나 그릴에서 앞뒤로 구운 뒤 조림장을 2~3회 발라가며 구워낸다.'),(661,121,5,'그릇에 담고 실파를 얹는다.'),(662,122,1,'감자는 0.3cm 두께로 채썰어 물에 담갔다 건져서 물기를 뺀다.'),(663,122,2,'청고추, 홍고추는 반으로 갈라 씨를 빼고 4cm 길이로 채썬다.'),(664,122,3,'프라이팬에 식용유를 두르고 채 썬 감자를 볶는다. 볶을때 소금, 흰후춧가루, 설탕 약간씩을 넣고 달달 볶는다.'),(665,122,4,'③번 감자가 다 볶아지면 ②번 고추를 넣고 한번 섞어준 다음 바로 불을 끈다.'),(666,123,1,'가는 파는 다듬어 씻은 뒤 4cm 길이로 썰고 양파는 채썬다.'),(667,123,2,'돼지고기는 5cm 길이로 채썰어 청주와 간장에 버무린다.'),(668,123,3,'굵은파는 굵게 다지고 마늘, 생강은 곱게 다진다.'),(669,123,4,'식용유를 두른 프라이팬에 다진 굵은파, 다진 마늘, 생강을 볶은 뒤 간장을 넣는다.'),(670,123,5,'돼지고기를 볶다가 양파를 넣는다.'),(671,123,6,'가는파를 넣어 살짝 볶은 뒤 소금, 후춧가루, 참기름을 넣는다.'),(672,124,1,'도토리묵과 청포묵, 오이, 게맛살을 사방 1.5cm 크기로 썬다.'),(673,124,2,'분량의 양념장을 만든다.'),(674,124,3,'준비한 재료를 그릇에 담고 양념장을 끼얹는다.'),(675,125,1,'고등어는 머리, 꼬리를 떼어내고 내장을 뺀 뒤 양쪽실을 떼어낸다. 한 입 크기로 썰어서 소금, 청주를 뿌리고 15분쯤 재워 놓는다.'),(676,125,2,'마른 고추는 2등분하고 생강은 편으로 썬다.'),(677,125,3,'고등어에 녹말가루를 묻혀 170℃의 식용유에서 노릇노릇하게 튀겨낸다.'),(678,125,4,'냄비에 분량의 양념 재료를 넣고 약간 끈기있게 졸여서 소스를 만든다.'),(679,125,5,'그릇에 고등어를 담고 소스를 끼얹는다.'),(680,126,1,'가지는 옆으로 반 갈라 김이 오른 찜통이나 밥솥에 넣고 쪄낸 뒤 젓가락으로 찢는다.'),(681,126,2,'마른 새우는 식용유를 두른 프라이팬에 바삭하게 볶는다.'),(682,126,3,'분량의 양념장을 만든다.'),(683,126,4,'가지에 양념장을 넣어 버무린 다음 볶아낸 새우와 함께 그릇에 담는다.'),(684,127,1,'냄비에 물, 다시마, 육수를 부어 놓는다.'),(685,127,2,'부추는 깨끗이 다듬고 씻은 후 6cm 길이로 썰고, 팽이버섯은 밑동을 잘라내고 씻어낸 후 물기를 뺀다.'),(686,127,3,'당근도 6cm 길이로 채썬다.'),(687,127,4,'소스를 만든다. (분마기에 깨와 된장을 넣고 갈다가 설탕, 간장, 술을 조금씩 부어 가면서 갈아낸다.)'),(688,127,5,'고기를 10~12cm 길이로 잘라 도마 위에 펴놓고, 준비한 채소를 조금씩 놓고 돌돌 말아낸다.'),(689,127,6,'냄비에 담가놓았던 다시마가 불면 냄비를 불에 올려서 끓인다.'),(690,128,1,'양파는 곱게 다져 물기를 빼준 후 달구어진 프라이팬에 기름을 두르고 갈색이 나도록 볶아둔다.'),(691,128,2,'소갈비는 살을 발라 곱게 다져 분량의 양념 재료를 넣어 양념해 골고루 끈기가 나도록 치댄다.'),(692,128,3,'살을 발라낸 갈비에 밀가루를 바르고 ②를 양면으로 도톰하게 바른다.'),(693,128,4,'석쇠에 호일을 깔고 기름을 발라 고기를 얹은 후 뒤집어가며 구워낸다.'),(694,129,1,'골뱅이는 체에 밭쳐 물기를 뺀 다음 먹기 좋게 반으로 썬다.'),(695,129,2,'오이는 두께 0.5cm 통으로 썬다.'),(696,129,3,'대파와 당근은 두께 0.2cm, 가로x세로 0.2cm X 4cm 로 썬다.'),(697,129,4,'양파는 두께 0.5cm로 채썬다.'),(698,129,5,'샐러리는 두께 0.2cm 통으로 썬다.'),(699,129,6,'양념 재료를 섞어둔다.'),(700,130,1,'두부는 가로 2cm, 세로 3cm, 두께 0.5cm로 썰어 소금을 뿌려 두었다가 물기를 없앤다.'),(701,130,2,'양념재료를 섞어 양념장을 만든다.'),(702,130,3,'식용유를 두른 프라이팬에 두부를 앞뒤로 노릇노릇하게 부쳐낸다.'),(703,130,4,'양념장을 걸쭉하게 졸여서 지진 두부에 바른다.'),(704,130,5,'다져놓은 홍고추와 통깨를 각각 얹는다.'),(705,131,1,'냉동 쇠고기(우둔살)를 얇게 채썬다.'),(706,131,2,'양념 재료를 섞어 양념을 만들고, 그릇에 썰어놓은 쇠고기를 담고 양념을 뿌려 잘 버무린다.'),(707,131,3,'접시에 상추를 깔고 양념한 쇠고기를 동그랗게 모양내어 담은 뒤 윗부분에 엄지손가락으로 오목하게 홈을 만든다.'),(708,131,4,'홈에 날계란 노른자를 얹는다. 노른자 둘레에는 잣가루를 뿌리고 노른자 윗부분을 잣으로 장식한다.'),(709,131,5,'배와 오이를 길이 5cm, 폭 4mm로 채썰어 양 끝을 가지런히 모아 칼로 정리한다.'),(710,131,6,'배와 오이로 주변을 장식하여 마무리한다.'),(711,132,1,'스파게티는 끓는 물에 소금과 식용유를 약간씩 넣은 뒤 15분 쯤 삶아낸 후, 찬물에 헹궈 체에 밭쳐 놓는다.'),(712,132,2,'햄과 베이컨은 길고 얇게 채썰어 놓고 양파는 잘게 다져 놓는다.'),(713,132,3,'냄비에 버터를 넣고 중불에서 녹인 다음, 베이컨과 햄을 볶다가 다진 양파를 넣고 볶는다.'),(714,132,4,'③에 바질을 넣고 살짝 볶다가 와인을 넣는다.'),(715,132,5,'④에 생크림과 우유를 넣고 양이 반으로 졸면 담가놓은 스파게티 면의 물기를 뺀 뒤, 프라이팬에 크림과 함께 넣고 볶아 소금, 후추로 간을 한다.'),(716,133,1,'닭은 내장을 제거하여 깨끗이 씻고, 찹쌀은 씻어 1시간 정도 물에 불린 후 건진다.'),(717,133,2,'대추는 돌려 깎아 씨를 빼고 수삼은 씻어 잔뿌리를 제거한다.'),(718,133,3,'닭 속에 찹쌀, 마늘, 대추, 수삼을 넣는다.'),(719,133,4,'왼쪽 다리 안쪽에 칼집을 넣어 그 사이에 오른쪽 다리를 넣어 꼬아준다.'),(720,133,5,'생강은 얇게 편썰어 준비한 후 냄비에 닭과 대파, 생강, 물을 넣어 끓인다.'),(721,133,6,'센불에서 끓인 후 불을 줄여 1시간 정도 푹 고아준다.'),(722,134,1,'다진 쇠고기는 분량의 양념을 한 뒤 프라이팬에 식용유를 두르고 볶아낸다.'),(723,134,2,'토마토는 8등분하여 두고 당근과 피망을 잘게 다진다.'),(724,134,3,'당근과 피망을 쇠고기와 함께 볶다가 밥을 넣고 볶으면서 소금과 후춧가루로 간을 한다.'),(725,134,4,'하트모양 틀에 볶아낸 밥을 60g씩 떠서 채운 뒤 모양을 만들어 떼어낸다.'),(726,134,5,'도시락 밑에 상추를 깔고 밥을 담아 사이사이에 토마토를 놓은 뒤 가운데에 파슬리를 올린다.'),(727,135,1,'유부는 끓는 물에 살짝 데쳐낸 뒤 물기를 짜고 끝을 잘라서 주머니를 만든다.'),(728,135,2,'맛살은 다져놓고, 실파는 줄기 10개는 따로 데쳐서 준비하고 나머지는 송송 썬다.'),(729,135,3,'계란은 잘 풀어서 실파, 맛살을 넣고 소금, 후춧가루로 간을 맞춘다.'),(730,135,4,'유부 속에 ③을 넣고 살짝 데친 실파로 묶는다.'),(731,135,5,'내열 용기에 물, 간장, 설탕을 넣고 잘 섞어서 유부가 넘어지지 않게 놓은 뒤 랩을 씌워 전자레인지에서 3분 동안 익힌다.'),(732,136,1,'감자는 깨끗이 씻어 껍질째 찜통에서 찐다.(전자레인지에서 익혀도 된다.)'),(733,136,2,'후루츠칵테일은 체에 받쳐 물기를 없앤다.'),(734,136,3,'익힌 감자를 반으로 잘라 바깥쪽에서 1cm 쯤을 남겨두고 속을 파낸다.'),(735,136,4,'파낸 속을 모아서 뜨거울 때 버터, 우유, 설탕, 계핏가루, 다진 파슬리를 넣고 버무린다.'),(736,136,5,'④를 다시 감자에 넣어 채운 다음 파슬리로 장식한다.'),(737,136,6,'도시락에 치커리를 깔고 감자를 담고, 은박컵에 후루츠칵테일을 담아 케첩과 함께 넣는다.'),(738,137,1,'쇠고기는 곱게 다져 양념을 해 잘 버무려두었다 양념이 충분히 배어 들면 식빵 크기가 되도록 모양을 잡는다.'),(739,137,2,'프라이팬이나 오븐에 ①의 쇠고기를 익힌다.'),(740,137,3,'식빵은 노릇하게 굽고 토마토는 슬라이스해둔다.'),(741,137,4,'양상추는 씻어 식빵 크기로 뜯어둔다.'),(742,137,5,'버터, 겨자, 소금, 후춧가루를 넣어 겨자버터를 만들어서 구워둔 식빵의 한쪽면에 바른다.'),(743,137,6,'식빵 위에 양상추 → 떡갈비(②) → 슬라이스치즈 → 토마토 슬라이스 → 피클을 순서대로 올린 후 겨자버터를 바른 식빵으로 덮는다.'),(744,138,1,'쇠고기는 채썰어 분량의 양념에 재워둔다.'),(745,138,2,'느타리와 표고버섯은 끓는 물에 데쳐 가늘게 찢고 양송이버섯은 껍질을 벗겨 얇게 썰고, 목이버섯은 물에 불려 씻은 후 먹기 좋게 뜯어 놓고 팽이버섯은 밑둥을 잘라낸다.'),(746,138,3,'양파는 가늘게 채썰고 풋고추, 당근은 길이 4cm, 두께 0.3cm로 채썰고, 미나리는 다듬어 4cm 길이로 준비하고 쇠고기는 야채와 같은 크기로 채썰어 준비한다.'),(747,138,4,'프라이팬에 식용유를 두르고 양파를 볶다가 투명해지면 고기를 넣어 볶아준다.'),(748,138,5,'당근과 준비된 버섯을 넣고 간장, 설탕, 청주를 넣어 살짝 볶는다.'),(749,138,6,'⑤에 육수와 녹말가루를 섞어 자작하게 붓고 미나리와 들깨가루를 넣은 후 참기름, 후춧가루로 마무리한다.'),(750,139,1,'닭고기는 기름기를 제거하고 소금과 요리술을 뿌려 두었다가 김 오른 찜통에 찐 뒤 식혀서 가늘게 찢어 놓는다.'),(751,139,2,'오이는 소금에 문질러 씻어서 길이 4cm, 폭 1cm로 썰고, 배는 껍질을 벗겨 씨를 도려낸 다음 오이와 같은 크기로 썰어 설탕물에 담갔다가 건진다.'),(752,139,3,'양상추는 손으로 뜯어서 물에 담그고 수삼은 칼등으로 긁어 잔털과 껍질을 벗긴 후 씨를 도려낸 다음 오이와 같은 크기로 썰어 설탕물에 담갔다가 건진다.'),(753,139,4,'대추는 돌려 깎아 씨를 발라내어 3등분하고 밤은 얇게 저며 썰어서 찬물에 씻어 건진다.'),(754,139,5,'분량의 재료를 섞어 머스터드 마요네즈를 만든다.'),(755,139,6,'재료와 머스터드 마요네즈를 버무려 완성한다.'),(756,140,1,'오징어는 다리를 잡아당겨 내장을 빼낸 뒤, 몸통 속에 손을 넣어 찌꺼기를 긁어낸다.'),(757,140,2,'손에 소금을 묻혀서 껍질을 벗기고 깨끗이 씻은 뒤 끓는 물에 소금을 넣고 삶아 건져서 5cm 두께로 썬다.'),(758,140,3,'새우는 꼬치로 등 쪽의 내장을 빼고 엷은 소금물로 씻은 뒤 끓는 물에 소금을 약간 넣고 삶아서 껍질을 벗긴다.'),(759,140,4,'컬리플라워는 작게 송이를 떼어 엷은 소금물에 살짝 데친다.'),(760,140,5,'접시에 컬리플라워와 오징어, 새우를 얹고 머스터드 마요네즈를 곁들인다.'),(761,141,1,'사과는 깨끗이 씻어서 길이로 반을 자른 후 씨를 도려낸다. 길이 4cm, 너비 1cm로 썰어낸다.'),(762,141,2,'자몽은 아래 위를 조금씩 잘라내고 껍질과 과육 사이사이에 칼집을 넣은 뒤 곡선을 따라 껍질을 벗겨서 한 쪽씩 뗀다.'),(763,141,3,'샐러리는 섬유질을 벗기고 반 갈라서 길이 4cm 로 썰고, 오이는 씻어서 4cm 길이로 토막 내 썬 다음 길이로 4등분한다.'),(764,141,4,'딸기는 흐르는 물에 씻은 후 4등분한다. 오렌지도 껍질을 제거해 과육을 분리해 놓는다.'),(765,141,5,'접시에 과일과 오이, 샐러리를 담고 오렌지 마요네즈를 곁들인다.'),(766,142,1,'훈제연어를 얇게 포 뜨고, 앤다이브는 한 잎씩 떼어 씻은 후 물기를 뺀다.'),(767,142,2,'트레비스는 손으로 뜯어서 찬물에 담갔다 건져 물기를 빼고, 양파는 얇게 링 모양으로 썰어서 찬물에 담가 매운맛을 없앤 뒤 건져서 물기를 뺀다.'),(768,142,3,'다진 양파와 올리브오일을 섞어 드레싱을 만든다.'),(769,142,4,'접시에 훈제연어와 앤다이브, 트레비스를 담고 양파를 얹은 뒤 케이퍼를 뿌리고 양파드레싱을 곁들인다.'),(770,143,1,'금치의 연한 잎으로 준비하여 깨끗이 씻어서 물기를 빼고, 양송이 버섯은 껍질을 벗겨서 얇게 저며썬다.'),(771,143,2,' 달군 팬에 베이컨을 구워 종이타월로 기름기를 닦아 내고 잘게 썬다.'),(772,143,3,'시에 시금치 깔고 그위에 양송이버섯과 베이컨을 얹은 뒤 가루치즈를 뿌리고 레몬 드레싱을 곁들인다.'),(773,144,1,'감자, 당근은 껍질을 벗겨서 큼직하게 썰어 모서리를 다듬은 뒤 물에 씻어 건진다.'),(774,144,2,'양파는 껍질을 벗겨서 씻은 후 반 잘라 큼직하게 썬다.'),(775,144,3,'샐러리는 섬유질을 벗기고 3cm 길이로 어슷하게 썬다.'),(776,144,4,'양송이는 기둥 끝을 약간 잘라내고 껍질을 벗겨 길이로 반 가른다.'),(777,144,5,'큼직하고 깊이가 있는 프라이팬에 버터를 두르고 감자, 당근, 양파를 넣고 볶다가 물을 부어서 끓인다. 끓기 시작하면 거품을 걷어내고 월계수잎을 넣은 후 감자가 반쯤 익을 때까지 끓인다.'),(778,144,6,' 감자가 반쯤 익으면 샐러리와 양송이버섯, 홀토마토를 넣고 끓인다. 중간중간 거품을 걷고 불을 줄여서 채소가 푹 무를 때가지 끓여 소금과 후춧가루로 간을 해서 수프 그릇에 담는다.'),(779,145,1,'햄은 0.5cm 두께로 썰어놓고 프랑크소시지는 반으로 가르고 베이컨은 4cm 길이로 썬다.'),(780,145,2,'김치는 속을 털어낸 뒤 4cm 길이로 썰고 두부는 0.5cm 두께로 썬다. 청고추, 홍고추는 어슷썰고 깻잎은 1cm 길이로 썰고 스파게티면은 삶아놓는다.'),(781,145,3,'분량의 양념 재료를 섞어 양념장을 만든다.'),(782,145,4,'전골냄비에 재료를 보기 좋게 돌려 담은 뒤 양념장을 넣어 섞고 끓으면 스파게티면을 넣고 푹 끓여낸다.'),(783,146,1,'곱창 겉에 붙어 있는 기름을 떼어 낸 뒤 굵은 소금으로 세게 주무른 뒤 속을 훑어 내리며 물로 씻는다.'),(784,146,2,'양은 굵은 소금과 밀가루로 문질러 씻은 뒤 끓는 물에 넣었다 꺼내어 검은 껍질과 안쪽의 얇은 막을 벗겨 낸다.'),(785,146,3,'대파는 10cm 길이로 썰고 생강은 껍질을 벗긴 후 얇게 저민다. 냄비에 물을 넣고 양과 곱창을 끓이다가, 곱창과 양을 건져놓고 육수는 식혀 기름기를 걷어낸다.'),(786,146,4,'당근, 양배추, 양파는 채썬다. 표고버섯은 미지근한 물에 불린 뒤 기둥을 떼어내고 채썬다.'),(787,146,5,'미나리는 다듬어 4cm 길이로 썬다.'),(788,146,6,'곱창과 양은 한 입 크기로 썰어 놓는다. 분량의 양념을 섞어 양념장을 만든다. 함께 버무려 전골냄비 가운데에 담고 썰어 놓은 야채를 돌려 담는다.'),(789,147,1,'아귀는 내장을 빼고 깨끗이 씻어 뼈째 토막 낸 뒤 가로 6cm, 세로 6cm 크기로 썰어 다시 씻는다.'),(790,147,2,'미더덕은 소금물에 씻은 뒤 꼬치로 몸통을 찔러 물을 뺀다.'),(791,147,3,'콩나물은 머리와 꼬리를 떼로 미나리는 5cm 길이로 썬다.'),(792,147,4,'대파는 두께 0.4cm로 어슷하게 썰고, 깻잎은 두께 0.7cm로 채썬다.'),(793,147,5,'찹쌀가루와 물을 섞어 따로 둔다.'),(794,147,6,'분량의 양념장 재료를 섞어 양념장을 만든다.'),(795,148,1,'볼에 강력분을 넣고 드라이이스트, 계란, 설탕, 소금을 넣고 미지근한 물을 부어 반죽한다.'),(796,148,2,'반죽이 어느 정도 뭉쳐졌으면 평평한 곳으로 옮겨 손바닥으로 힘주어 반죽한 다음 어느 정도 매끄러워지면 실온에 두었던 버터와 우유를 조금씩 넣어 가며 치댄다.'),(797,148,3,'반죽이 얇게 펴질 정도까지 충분이 치댄 다음 검은 깨를 섞는다.'),(798,148,4,'반죽을 둥글려 윗면을 매끄럽게 한 뒤 볼에 넣는다. 젖은 천을 덮은 후 따뜻한 곳에 두어 1시간 동안 1차 발효를 시킨다.'),(799,148,5,'반죽을 꺼내어 두 덩이로 나누어 둥글린 다음, 이번에는 마른 천을 덮어 10분 정도 둔다.'),(800,148,6,'반죽을 밀대로 펴서 22cm X 15cm 로 만든다.'),(801,149,1,'삼겹살은 8cm 길이로 썰어낸 뒤 칼등으로 자근자근 두드린다.'),(802,149,2,'①에 소금, 생강즙, 후춧가루로 밑간을 하되 이때는 고기두께가 0.2cm 정도가 되게 한다. 고기두께가 얇으면 얇을수록 좋다.'),(803,149,3,'붉은 고추는 반으로 갈라서 씨를 빼고 8cm 길이로 채썬다.'),(804,149,4,'무순은 깨끗이 씻어 준비한다.'),(805,149,5,'찹쌀가루를 체에 밭친 후, ②의 고기를 양면에 묻혀 낸다.'),(806,149,6,'⑤에 붉은 고추와 무순을 넣고 돌돌 말아낸 다음 꼬치로 고정시킨다. 고기가 얇으면 꼬치가 없어도 된다.'),(807,150,1,'배추는 속대로 준비하여 씻어서 칼로 길이로썬다. 무는 넙적넙적하게 썬다.'),(808,150,2,'쇠고기는 채썰어 양념에 버무린다. 굵은파는 어슷썬다.'),(809,150,3,'냄비에 식용유를 두르고 양념한 쇠고기를 넣어 볶는다.'),(810,150,4,'물을 넣고 된장과 고추장을 체에 걸러 푼다. 국물이 끓으면 배추와 무를 넣고 푹 끓인다.'),(811,150,5,'굵은 파를 넣고 마늘을 넣어 끓여 소금으로 간을 맞춘다.'),(812,151,1,'멥쌀은 씻어서 충분히 불린 다음 물기를 빼고 소금을 넣어 반만 빻고, 나머지는 쑥을 넣어 곱게 빻는다.'),(813,151,2,'대추는 물 10컵을 넣고 물이 없어질 때까지 끓인 뒤 체에 걸러 걸쭉한 대추고를 만든다.'),(814,151,3,'①의 흰 멥쌀가루의 반은 뜨거운 물을 넣어 익반죽을 하고 나머지는 대추고를 넣어 반죽한다. 쑥을 넣은 멥쌀가루도 익반죽한다.'),(815,151,4,'풋콩은 깨끗이 씻어 소금을 뿌리고 깨는 곱게 빻아 꿀을 넣어 버무린다.'),(816,151,5,'녹두는 따뜻한 물에 불려 껍질을 벗긴 뒤 푹 쪄서소금을 넣고 믹서에 곱게 갈아 체에 내린다. 냄비에 녹두 고물과 설탕을 넣고 약한 불에서  볶은 뒤 계핏가루를 넣고 섞는다.'),(817,151,6,'반죽을 조금씩 떼어 각각의 소를 넣고 빚어, 솔잎을 깔아 준비한 찜통에서 30분간 찐다. 쪄낸 송편을 찬물에 헹궈 참기름을 바른다.'),(818,152,1,'녹두는 따뜻한 물에 충분히 불린 후 손으로 비벼 껍질을 벗기고 물기를 뺀 뒤 믹서에 물을 넣고 곱게 간다.'),(819,152,2,'돼지고기는 다진다. 분량의 양념 재료를 섞어 양념을 만든 후 돼지고기를 넣어 양념한다.'),(820,152,3,'느타리버섯은 끓는 물에 데쳐 물기를 짜서 손으로 찢어 두고, 석이버섯은 따뜻한 물에 불려 비벼 씻은 다음 곱게 채썬다. 대파는 어슷하게 썰어 낸다.'),(821,152,4,'갈아놓은 녹두를 소금, 후춧가루로 간을 해서 프라이팬에 식용유를 넉넉히 두르고 한 숟가락씩 얹어 지진다.'),(822,152,5,'느타리버섯을 전 가운데에 얹고 녹두반죽을 조금만 떠서 버섯 둘레에 얹고 돼지고기, 숙주, 석이버섯, 다진 파, 실고추를 전 위에 올린다.'),(823,152,6,'전의 앞뒤를 노릇하게 지져낸다. 그릇에 담고 초간장을 곁들인다.'),(824,153,1,'쇠고기는 힘줄 없는 부위를 사용한다. 길이 6cm, 너비 1cm, 두께 0.4cm로 자른 다음, 칼집을 넣는다. 분량의 양념 재료로 양념장을 만들어 1/2 분량에 재웠다가 프라이팬에 익힌다.'),(825,153,2,'마른 표고버섯은 따뜻한 물에 불린 뒤 기둥을 떼어낸다. 표고버섯, 도라지, 당근, 오이는 너비 1cm, 길이 5cm, 두께 0.4cm로 자른다.'),(826,153,3,'표고버섯은 남은 양념장에 버무린다.'),(827,153,4,'도라지는 소금에 비벼 씻은 다음 헹구어낸다.'),(828,153,5,'프라이팬에 식용유를 두르고 표고버섯, 도라지, 당근, 오이를 각각 볶아내면서 소금과 참기름으로 간을 해준다.'),(829,153,6,'산적꼬치에 준비된 재료를 색 맞추어 꽂은 다음 잣가루를 뿌려낸다.'),(830,154,1,'토란은 껍질을 벗기고 큰 것은 2~4등분한다. 쌀뜨물에 소금을 약간 넣고 끓으면 토란을 넣고 살짝 삶아낸다.'),(831,154,2,'쇠고기는 끓는 물에 덩어리째 넣고 삶다가 다시마, 무를 넣어 푹 끓인다.'),(832,154,3,'어느정도 국물이 우러나면 건더기를 건지고 쇠고기, 무는 0.5cm 두께로 썰어 다진 마늘, 후춧가루, 참기름으로 양념한다.'),(833,154,4,'사태국물을 다시 끓이다가 양념한 쇠고기와 무를 넣는다.'),(834,154,5,'④에 토란, 다시마를 넣고 국간장으로 간을 맞춘 다음 한소끔 끓여 낸다.'),(835,154,6,'마지막에 어슷 썬 파를 넣는다.'),(836,155,1,'쇠고기는 곱게 채썬다.'),(837,155,2,'목이버섯은 미온수에 불린 후 찬물로 헹구어 물기를 짜서 적당한 크기로 뜯고, 느타리버섯은 끓는 물에 데친 후 찬물에 헹구어 물기를 짠 후 손으로 찢는다.'),(838,155,3,'실파는 4cm 길이로 썰고 홍고추는 씨를 털어 4cm 길이로 채썬다.'),(839,155,4,'분량의 양념 재료를 섞어 양념장을 만들고 양념장을 나누어 쇠고기, 느타리버섯, 목이버섯을 각각 양념한다.'),(840,155,5,'전골냄비에 준비한 재료를 돌려 담고 물 3컵을 붓고 끓여 국간장과 소금으로 간을 맞춘다.'),(841,156,1,'고등어는 머리, 꼬리를 떼어내고 3cm 크기로 어슷썰어 내장을 뺀다.'),(842,156,2,'무는 2cm 두께로 썰어 큰 것은 4등분, 작은 것은 2등분하여 끓는 물에 데쳐낸다.'),(843,156,3,'파는 3cm 길이로 어슷썬다.'),(844,156,4,'냄비에 고등어와 무를 분량의 양념 재료로 만든 양념장의 2/3를 얹어 뚜껑을 덮고 조린다.'),(845,156,5,'끓어 오르면 은근한 불에서 양념장을 숟가락으로 끼얹어 주며 조리다가 나머지 양념장을 끼얹어 센불에서 조린다.'),(846,156,6,'고등어와 무를 그릇에 담고 파를 곁들인다.'),(847,157,1,'끓는 물에 식용유 1큰술과 당면을 넣고 삶다가 투명하게 삶아지면 소쿠리에 밭쳐서 물에 한 번 헹궈 간장 2큰술과 참기름 1큰술에 무친다.'),(848,157,2,'쇠고기는 기름기를 떼어내고 결 방향대로 곱게 채썰어 핏물을 뺀 다음 분량의 양념 재료로 쇠고기 양념을 만들어 재워둔다.'),(849,157,3,'느타리버섯은 끓는 물에 소금을 약간 넣고 데쳐서 찬물에 헹군 뒤 물기를 꼭 짜서 가늘게 찢어 소금과 참기름에 버무린다.'),(850,157,4,'오이는 소금으로 문질러 씻은 뒤 4cm 길이로 돌려 깎아서 가늘게 채썰어 소금에 살짝 절이고 당근은 4cm 길이로 곱게 채썰고, 양파도 곱게 채썬다. 배는 껍질을 벗겨 씨를 도려낸 다음 4cm 길이로 채썰어서 색이 변하지 않도록 설탕물에 담가둔다.'),(851,157,5,'프라이팬에 느타리버섯, 오이, 당근, 쇠고기 순으로 소금과 후춧가루로 간하여 재빨리 볶아서 넓은 쟁반에 펴서 식힌다.'),(852,157,6,'큼직한 볼에 당면과 ⑤를 넣고 무쳐서 소금으로 간하고, 채썰어놓은 배와 통깨를 넣고 살살 무쳐서 접시에 담는다.'),(853,158,1,'양파와 파, 마늘은 곱게 다진다.'),(854,158,2,'된장 3큰술과 고추장 1큰술에 ①과 고춧가루를 넣고 잘 섞는다.'),(855,158,3,'먹기 직전에 참기름을 넣고 잘 섞어 마무리한다.'),(856,159,1,'배추김치는 속을 털어내고 국물을 짠 후 2cm 두께로 채썬다.'),(857,159,2,'돼지고기를 채썰어 간장 1작은술, 청주 1큰술, 후춧가루 약간을  넣고 재워둔다.'),(858,159,3,'죽순, 양송이버섯은 모양대로 얇게 썰고 피망도 채썬다. 마른 고추를 어슷썰어 씨를 털어내고 대파, 마늘, 생강은 곱게 채썬다.'),(859,159,4,'프라이팬에 식용유를 두르고 충분히 달궈지면 마른 고추를  볶다가  대파, 마늘, 생강을 넣어 볶는다.'),(860,159,5,'④에 돼지고기를 넣어 센불에서 볶은 후 김치, 죽순, 양송이버섯을 넣어 같이 볶는다.'),(861,159,6,'⑤에  피망을 넣어 볶고 소금, 후춧가루로 간하고 참기름으로 마무리한다.'),(862,160,1,'닭고기는 깨끗이 씻어 앞뒤로 칼집을 넣어주고 소금, 후춧가루, 청주로 밑간을 해둔다.'),(863,160,2,'분량의 양념 재료를 섞어 양념장을 만들고 ①에 버무려 30분 가량 재워둔다.'),(864,160,3,'녹말가루와 튀김가루를 섞어 재워둔 닭고기에 묻히고 160℃의 기름에서 바삭하게 튀긴다.'),(865,161,1,'오징어는 몸통과 다리를 분리하고 몸통은 소금을 뿌렸다가 껍질을 벗기고 다리는 곱게 다진다.'),(866,161,2,'표고버섯은 밑동을 제거하고 두부는 면보에 싸서 물기를 짠다. 당면은 끓는 물에 데쳐 놓는다.'),(867,161,3,'표고버섯, 두부, 당면, 쇠고기, 당근, 피망은 곱게 다진다.'),(868,161,4,'간장, 식초, 깨소금을 섞어 초간장을 만든다.'),(869,161,5,'깻잎과 양상추는 곱게 채썬 다음 샐러리 잎과 함께 얼음물에 담가놓고 오븐은 200℃로 예열해놓는다.'),(870,161,6,'다져놓은 오징어다리, 표고버섯, 두부, 당면, 쇠고기, 당근, 피망을 용기에 담아 양념 재료를 차례로 넣고 골고루 섞는다.'),(871,162,1,'표고버섯은 따뜻한 물에 불려 밑동을 떼어내서 채썰고 죽순도 깨끗이 씻어 빗살 모양으로 얇게 썬다.'),(872,162,2,'새우살은 끓는 물에 소금을 약간 넣어 데쳐낸다. 새우를 삶아낸 물 1과 1/2컵을 남겨서 소스용 재료로 사용한다.'),(873,162,3,'달군 팬에 채썬 표고버섯, 죽순, 새우살, 완두콩을 넣고 볶는다.'),(874,162,4,'식용유에 누룽지를 튀긴다.'),(875,162,5,'튀겨낸 누룽지에 ③을 넣고 홍고추, 다진 마늘을 넣고 소금으로 간한다.'),(876,162,6,'팬에 분량의 소스 재료를 넣어 끓인 후 녹말물을 풀어 넣어 걸쭉한 소스를 만든 다음 ⑤에 붓고 살짝 끓인다.'),(877,163,1,'가래떡은 3cm 길이로 썰어서 끓는 물에 데쳐낸다.'),(878,163,2,'파프리카는 떡 크기에 맞춰 썰어 살짝 데치고, 브로콜리는 작은 줄기로 떼어내 끓는 소금물에 데쳐낸다.'),(879,163,3,'분량의 양념 재료를 섞어 양념장을 만든다.'),(880,163,4,'꼬치에 떡, 파프리카, 브로콜리 순으로 꽂는다.'),(881,163,5,'④에 양념장을 발라 떡이 고루 익을 때까지 그릴에 굽는다.'),(882,164,1,'양파, 당근은 다진다.'),(883,164,2,'실파는 송송썬다.'),(884,164,3,'두부는 곱게 으깬다.'),(885,164,4,'찬밥, 양파, 당근, 실파, 두부를 섞고 콩가루와 계란을 넣은 뒤 소금과 후춧가루로 간을 맞춘다.'),(886,164,5,'프라이팬에 기름을 두르고 둥글게 지진다.'),(887,165,1,'쌀은 씻어서 30분 정도 불린 후 소쿠리에 건져 물기를 빼고, 팥은 씻어서 냄비에 담고 팥이 잠길 정도로 물을 부어 끓인 뒤 살짝 끓어오르면 물을 버린다.'),(888,165,2,'①에 다시 물 8컵을 부어 1시간 정도 푹 삶는다.'),(889,165,3,'②에 불린 쌀을 넣고 주걱으로 한 번씩 저어가며 쌀알이 완전히 퍼질 때까지 끓인다.'),(890,165,4,'찹쌀과 쌀가루를 섞어서 가루 낸 것에 찬물 3/4컵을 부어 반죽해서 지름 1~2cm 정도의 새알심을 동그랗게 빚는다.'),(891,165,5,'끓는 소금물에 ④를 넣고 새알심이 익어서 위로 떠오르면 찬물에 식혀 건져낸다.'),(892,165,6,'센불에서 죽이 끓을 때 새알심을 넣고 소금으로 간을 맞춘 뒤 불에서 내린다.'),(893,166,1,'냉장고에 보관해둔 버터를 주사위 모양으로 썬다.'),(894,166,2,'체에 밀가루와 소금을 넣고 쳐서 큰 볼에 담는다.'),(895,166,3,'②에 버터 썬 것을 넣고 섞은 후 버터에 밀가루를 입힌다. 버터를 손으로 한 개씩 으깬 다음 양손으로 비벼서 보슬보슬한 가루를 만든다.'),(896,166,4,'찬물을 넣고 손가락으로 원을 그리면서 섞은 후 대충 덩어리로 뭉쳐서 비닐백에 담아 밀대로 5mm 정도 두께로 밀어둔다.'),(897,166,5,'④를 냉장고에 1~2시간 정도 넣어둔다.'),(898,166,6,'아몬드 크림을 만든다. 실온에 두었던 버터를 볼에 담고 거품기로 저어서 크림 상태로 만든다. 여기에 설탕을 넣고 힘있게 섞은 후 계란을 넣고 잘 섞어준 뒤 아몬드 가루를 넣고 섞는다.'),(899,167,1,'고구마 줄기는 미지근한 물에 한시간 정도 불린다.'),(900,167,2,'끓는 물에 고구마 줄기를 20분 정도 삶아낸 뒤 찬물에 헹구어 물을 갈아주며 하루 정도 물에 담가둔다.'),(901,167,3,'분량의 재료를 섞어 양념장을 만든다.'),(902,167,4,'고구마 줄기는 물기를 짜고 5cm 길이로 썬다.'),(903,167,5,'④에 양념장을 넣어 간이 배도록 무친다.'),(904,167,6,'프라이팬에 들기름을 두르고 ⑤를 넣어 볶는다.'),(905,168,1,'어묵은 가운데 1/3 정도를 파낸다.'),(906,168,2,'닭고기 안심은 곱게 다져 소금, 후춧가루를 넣는다.'),(907,168,3,'말린 표고버섯은 미지근한 물에 불려 기둥을 떼어내고 가늘게 채썬다.'),(908,168,4,'오이는 돌려 깎아 채썬 뒤 소금에 살짝 절이고 물기를 짠다.'),(909,168,5,'닭고기살에 표고버섯, 오이를 넣는다.'),(910,168,6,'어묵 가운데 녹말가루를 뿌리고 ⑤를 채운다.'),(911,169,1,'쇠고기는 찬물에 담가 핏물을 없애고 양지머리와 함께 한번 끓여 첫 물을 버리고, 다시 푹 고아서 육수를 준비한다.'),(912,169,2,'계란은 노른자와 흰자를 나누어 지단을 부친다.'),(913,169,3,'쇠고기는 채썰거나 다져서 양념 재료로 양념하여 볶는다.'),(914,169,4,'가래떡을 어슷썰어 물에 씻어 건진다.'),(915,169,5,'①의 육수에 간장과 소금으로 간을 맞추고  채썬 파와 다진 마늘을 넣어 팔팔 끓으면 떡을 헤쳐서 넣고, 떡이 익어서 떠오를 때까지 끓인다.'),(916,169,6,'대접이나 그릇에 떡국을 담고 위에 고기와 지단을 고명으로 얹고 후춧가루를 약간 뿌려 낸다.'),(917,170,1,'멥쌀은 깨끗이 씻어서 6시간 정도 충분히 불린 후 건져 소금을 넣고 가루로 빻아서 곱게 체에 친다.'),(918,170,2,'멥쌀가루에 물을 뿌린 다음 버무려서 찜통이나 시루에 넣고 충분히 찐다.'),(919,170,3,'쪄낸 떡을 둘로 나누어 반은 그대로 절구에서 찰지게 될 때까지 치고, 나머지는 데친 쑥을 섞어서 쑥색이 고루 들 때까지 찧는다.'),(920,170,4,'③의 떡을 큰 도마에 놓고 참기름을 발라가며 일정한 크기로 떼어낸 다음 둥근 모양으로 빚고 떡살로 눌러 문양을 낸 후 참기름을 발라 마무리한다.'),(921,171,1,'생강은 껍질을 벗겨 씻은 뒤 얇게 저민다.'),(922,171,2,'통계피는 씻어서 잘게 부순다.'),(923,171,3,'곶감은 가루를 털고 젖은 수건으로 표면을 깨끗이 닦은 뒤 꼭지와 밑동을 살짝 자른 다음 옆면을 칼로 잘라 씨를 발라낸다.'),(924,171,4,'호두는 통째로 미지근한 설탕물에 잠시 담갔다가 꺼내어 꼬치로 껍질을 벗긴다.'),(925,171,5,'곶감을 넓게 편 다음 호두를 넣고 김발로 꼭꼭 말아 곶감쌈을 만든다.'),(926,171,6,'생강은 찬물 10컵을 붓고 향이 우러나도록 약한 불에서 30~40분간 끓인다.'),(927,172,1,'닭고기는 토막 내어 소금, 후춧가루, 정종에 재워둔다.'),(928,172,2,'홍고추, 청고추, 대파, 생강, 마늘은 굵게 다진다.'),(929,172,3,'소스 재료를 섞는다.'),(930,172,4,'닭고기에 계란을 넣고 감자전분을 넣어 무치듯 반죽한다.'),(931,172,5,'170℃ 기름에 튀긴다.'),(932,172,6,'프라이팬에 기름을 넣고 대파, 마늘, 생강, 홍고추, 청고추를 넣고 볶는다.'),(933,173,1,'멥쌀과 찹쌀은 불린 다음 소금 1큰술을 넣고 곱게 빻는다.'),(934,173,2,'①에 물을 10큰술 정도 넣어 손으로 비비면서 다시 한 번 체에 내린다.'),(935,173,3,'팥은 물을 붓고 푹 삶는다.'),(936,173,4,'충분히 물러졌으면 남은 물을 따라내고 잠깐 불에 올려 뜸을 들인 후 소금 1큰술과 함께 절구에 넣고 팥알이 부서지도록 대강 찧는다.'),(937,173,5,'시루에 면보를 깔고 ④의 팥고물을 평평하게 깐 다음 ②의 쌀가루를 2cm 두께로 번갈아 안쳐 김 오른 솥 위에 시루째 올린다.'),(938,173,6,'김이 새지 않도록 솥과 시루 사이에