INSERT INTO `recipe` VALUES (1,'나물비빔밥','육수로 지은 밥에 야채를 듬뿍 넣은 영양만점 나물비빔밥!','60분','580Kcal','4인분','https://cdn.pixabay.com/photo/2015/05/11/09/59/bibimbap-762218_960_720.jpg','IexoOd9y1hM'),(2,'오곡밥','정월대보름에 먹던 오곡밥! 영양을 한그릇에 담았습니다.','60분','338Kcal','4인분','https://cdn.pixabay.com/photo/2015/05/02/00/59/herbs-749360_960_720.jpg','8_iDZ8FuKPo'),(3,'잡채밥','잡채밥 한 그릇이면 오늘 저녁 끝! 입 맛 없을 때 먹으면 그만이지요~','30분','520Kcal','4인분','https://img.freepik.com/premium-photo/soy-glass-noodles-with-shiitake-mushrooms-and-chicken-meat-wooden-table-top-view_89816-19333.jpg?w=1060','JTn1Dd2nkx8'),(4,'콩나물밥','다이어트에 으뜸인 콩나물밥. 밥 물 넣을때 평소보다 적게 넣는거 잊지마세요!','40분','401Kcal','4인분','https://img.freepik.com/premium-photo/soybean-sprouts-soup-kongnamul-guk-korean-food-style-refreshing-served-on-black-bowl-white-table-with-sliced-green-onion-on-top_511235-1169.jpg?w=1060','6rkOm6kbPqo'),(5,'약식','집에서도 쉽게 만들어 맛있게 먹을 수 있답니다. 어려워 마시고 만들어 보세요~!','60분','259Kcal','4인분','https://img.freepik.com/premium-photo/selected-focus-yakgwa-korean-traditional-confectionery-sweet-candy-honey-cookies_511235-8172.jpg','SB771cg5d08'),(6,'호박죽','호박죽 한 그릇이면 하루가 든든하답니다.','30분','115Kcal','4인분','https://cdn.pixabay.com/photo/2015/04/17/04/41/pumpkin-porridge-726740__480.jpg','wXAghE8wUA0'),(7,'흑임자죽','검은깨를 갈아서 만든 고소함이 가득한 흑임자죽. 남녀노소 모두 사랑하는 맛!','25분','450Kcal','4인분','https://mblogthumb-phinf.pstatic.net/MjAxNzA4MjlfMiAg/MDAxNTA0MDEzMDkxNjg5.LLyNrodVn_Jnamyr1o6ic3oCFgEJ0M7Xthp7e4mecBkg.2KZeabGYQhbaJNa_4_cSMMGDLR4EE874L-0CwXbtElYg.JPEG.witchyoli/%ED%9D%91%EC%9E%84%EC%9E%90%EC%A3%BD_%284%29.JPG?type=w800','2wlFyY2JCvQ'),(8,'카레라이스','향긋한 카레향이 너무 좋지요. 누구나 좋아하는 만들기도 간편한 음식입니다.','30분','650Kcal','4인분','https://recipe1.ezmember.co.kr/cache/recipe/2019/04/30/61f77a2e671ecfdbb5fde2d5c94f26c31.jpg','7emvnX9RT1A'),(9,'오므라이스','각종 채소를 계란 속에 꼭꼭 숨겨 편식하는 아이들도 맛있게 먹어요~','30분','630Kcal','4인분','https://cdn.pixabay.com/photo/2021/07/08/09/11/omurice-6396326__340.jpg','MEDlqEVpPn8'),(10,'감자수제비','쫀득쫀득한 수제비와 담백한 맛의 감자가 이뤄내는 하모니!','60분','410Kcal','4인분','https://recipe1.ezmember.co.kr/cache/recipe/2020/06/26/c4547eb30d56a545fad6def2899a6c5f1.jpg','N71KGNKTjz8'),(11,'냉면','더운 여름, 살얼음 동동 띄운 시원한 냉면 한그릇 생각나시죠~','50분','630Kcal','4인분','https://vrthumb.imagetoday.co.kr/2018/08/10/tip250t015226.jpg','QIgLSko7Kmc'),(12,'동치미막국수','시원한 동치미에 쫄깃한 국수를 말아서 만들어보세요.','30분','400Kcal','4인분','https://cdn.pixabay.com/photo/2018/06/04/13/36/cold-noodles-3453218__340.jpg','lone_v6zDds'),(13,'열무김치냉면','맛있게 담근 열무김치에 냉면을 말아 먹어 보세요~ 새콤달콤 끝내줍니다!','25분','625Kcal','4인분','https://vrthumb.imagetoday.co.kr/2015/10/29/tip242t000917.jpg','AEw3m5bek6M'),(14,'채소국수','갖가지 야채를 듬뿍 넣어서 만든 요리로 출출할 때 간식거리로 아주 좋답니다.','30분','460Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2020/10/08/a199068df7405881ba2b235ac69a5d2d1.jpg','g1A59nX2URQ'),(15,'해물국수','해물로 시원한 국물에 국수를 말아 드셔보세요~','40분','530Kcal','4인분','https://recipe1.ezmember.co.kr/cache/recipe/2020/10/08/a199068df7405881ba2b235ac69a5d2d1.jpg','7txoB9qnKWs'),(16,'만둣국','만두를 예쁘게 만들면 이쁜 딸을 낳는다고 하죠? 가족들과 오손도손 맛있는 만두국 만들어 드셔보세요~','40분','540Kcal','4인분','https://img.freepik.com/premium-photo/mandu-tteokguk-soup-or-slice-rice-cake-and-dumpling-soup-seollal-festival-food-top-view-on-yellow-background_511235-7863.jpg','FZEBKjqzVdI'),(17,'다시마냉국','철분과 무기질이 풍부한 다시마로 피부건강을 지켜보세요~','20분','63Kcal','4인분','https://recipe1.ezmember.co.kr/cache/recipe/2019/07/01/053500bf2d878238c5fcf43113f94cff1.jpg','kGHyMi49XKk'),(18,'두부국','부드러운 두부로 맛나는 두부국을 끓여 단백함을 맛보세요.','40분','120Kcal','4인분','https://recipe1.ezmember.co.kr/cache/recipe/2019/11/20/79b3fc28c739721a8375fa52f97a4aac1.jpg','TfJT3l44o0c'),(19,'두부조개탕','국물이 정말 시원해서 속풀이 식단으로도 안성맞춤!','30분','130Kcal','4인분','https://cdn.pixabay.com/photo/2015/05/02/01/04/miso-soup-749368__480.jpg','Mg9zeD01kEw'),(20,'무맑은국','고향의 맛을 느낄 수 있는 무국. 밥한그릇 뚝딱이죠!','30분','75Kcal','4인분','https://t1.daumcdn.net/cfile/tistory/171BAA0F4A1A0428B2','NefPocSaeDU'),(21,'미역국','미역국은 철분이 풍부하게 함유된 음식이라 여자들에게 특히 좋은 음식이라 하지요.','30분','95Kcal','4인분','http://m.eommakimchi.com/web/product/big/201709/134_shop1_667697.jpg','znpwSp0Ro2I'),(22,'미역냉국','더운 여름, 새콤달콤 시원한 미역냉국으로 입맛을 살려보세요~','30분','82Kcal','4인분','https://recipe1.ezmember.co.kr/cache/recipe/2018/08/03/121a60a7ecf0c58352ddbf13a6e5bd091.jpg','HW8MIQWryTg'),(23,'생태국','생태국에 콩나물을 넣어주면 시원함이 배가 됩니다.','30분','110Kcal','4인분','https://cdn.shopify.com/s/files/1/0585/8495/7094/files/main_e958f625-bf5b-4737-bf60-642cccb39634.jpg?v=1632271026','1pH8DWG_gHM'),(24,'연어까르파치오','독특한 바질향이 연어에 쏘옥~ 올리브오일로 한층 부드러운 연어회랍니다.','30분','120Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2015/06/08/ec2a3fba845dd666a0d06eb78f450838_f.jpg','IkREnMzcr_U'),(25,'오이냉국','아삭아삭한 오이와 새콤달콤한 냉국의 조화!','20분','82Kcal','4인분','http://shop.biumfood.com/upload/1585804088image_product095.jpg','U1Mg8EVh-xk'),(26,'해산물샐러드','시원한 해산물 샐러드~ 상큼한 레몬과 와인을 넣은 드레싱으로 깔끔하게~','30분','180Kcal','2인분','https://img.freepik.com/free-photo/spicy-mixed-seafood-salad-with-thai-food-ingredients_1150-26433.jpg?w=1060&t=st=1664296685~exp=1664297285~hmac=9f193237918a18c43e1191a729b4dc7751a804e06486eabbe5e810cb9cdb1da3','fYrML4TTBbM'),(27,'재첩국','재첩은 해감을 잘 한다음 사용하셔야 해요. 그래야 깔끔한 맛을 낼 수 있어요.','30분','130Kcal','4인분','https://cdn.pixabay.com/photo/2017/06/24/16/43/my-handbook-states-2438131__480.jpg','55AaSanHv4Y'),(28,'구운감자와도미구이','감자의 고소함과 도미의 담백함이 어울리는 너무나도 깔끔한 맛의 음식이예요.','60분','225Kcal','2인분','https://img.freepik.com/free-vector/flat-chinese-new-year-reunion-dinner-food-collection_23-2149228558.jpg?w=740&t=st=1664458037~exp=1664458637~hmac=c8dbda889640f530fa918c32ead475be433401020646fc290a9ca4c8f7d52fab','39wAwhGQpVY'),(29,'쇠고기산적','고기와 버섯이 잘 어우러져 언제나 먹어도 질리지 않고 맛있어서 자주 생각나는 음식이죠~!','40분','320Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2017/10/02/b9c76fee369b10759348df463255d0791.jpg','Hi5ESWU8NaA'),(30,'쇠고기양송이볶음','쫄깃하고 부드러운 쇠고기와 양송이의 만남! 향도 맛도 일품이예요~','40분','210Kcal','4인분','https://shop.biumfood.com/upload/1576138610image_product033.jpg','TKVmLLwcEr8'),(31,'팥국수','팥죽으로만 먹던 팥을 국수로 먹어보세요. 국수가 새롭게 느껴진답니다.','30분','692Kcal','4인분','http://dalimjuk.com/web/product/big/202104/5aaca13fcc347d44a8a7f3122dd0723d.jpg','RXyUXSI_7o4'),(32,'죽순표고버섯볶음나물','향이 좋은 죽순과 표고버섯을 같이 볶아 보세요. 입맛 살리는 음식이 될거에요.','20분','105Kcal','4인분','https://i.ytimg.com/vi/-vjkmFHZZsc/maxresdefault.jpg','bcBI1kPqasQ'),(33,'부추표고버섯볶음','향긋한 부추와 표고버섯을 같이 볶아보세요.','30분','150Kcal','4인분','https://t1.daumcdn.net/cfile/tistory/99F6B73359EEB45133','lORhxB9d5mI'),(34,'두부드레싱과 채소샐러드','두부의 부드러운 촉감이 너무 좋네요. 물론 몸에도 좋은 추천건강드레싱이예요~','30분','91Kcal','2인분','https://t1.daumcdn.net/cfile/tistory/1304D23A4E0C32C80F','4kUi006UpYc'),(35,'콩나물무침','아주 흔한 요리이지만,그 맛을 내는데도 비법이 있죠!','20분','82Kcal','4인분','https://shop.biumfood.com/upload/1535360125_1841505.jpg','cACd0cF92Q'),(36,'우엉조림','아삭한 우엉을 맛깔스러운 간장 양념으로 조려보세요~ 맛깔스러운 간단한 반찬, 만들어볼까요?','30분','75Kcal','4인분','https://thumb.photo-ac.com/fe/fe81415a66ca465f1cbb376ec2ac4034_t.jpeg','ZHbYTUq8M7U'),(37,'바질토마토두부샐러드','샐러드를 더욱 상큼하게 만들어주는 참빛고운 포도씨유로 요리에 상큼함을 더해보세요~','20분','147Kcal','2인분','https://cdn.pixabay.com/photo/2015/10/23/11/23/salad-1002839_960_720.jpg','9c7DpfGN2JA'),(38,'멸치볶음','고소하고 짭잘한 멸치볶음 하나면 밥 한공기 뚝딱이죠.','20분','210Kcal','4인분','http://m.eommakimchi.com/web/product/big/201711/95_shop1_578512.jpg','WYiE3ol6ttY'),(39,'갈치무조림','구이가 지겨우시다면 조림으로 즐겨보세요~ 무를 넣어 더 맛있습니다!','40분','220Kcal','4인분','https://cdn.shopify.com/s/files/1/0585/8495/7094/products/20220311_125128.jpg?v=1647049268','dTsYsXpJ30Y'),(40,'닭불고기','닭고기로 만든 불고기! 간장양념이 맛있어요~','35분','360Kcal','4인분','https://img.freepik.com/premium-photo/dakgalbi-barbeque-chicken-with-vegetable-and-cheese-mixed-in-hot-pan_49071-7232.jpg','dRrkWLOfxp0'),(41,'두부다시마말이','짭조롬하면서 단백한 두부다시다말이. 다이어트 음식으로 손색없지요.','30분','110Kcal','2인분','https://t1.daumcdn.net/cfile/blog/256F06385835265821','MQrbgNnglqo'),(42,'팥칼국수','구수하고 담백한 팥칼국수~  걸쭉한 팥국물이 딱이예요!','50분','469Kcal','2인분','http://dalimjuk.com/web/product/big/202104/5aaca13fcc347d44a8a7f3122dd0723d.jpg','FIODsu6PLj4'),(43,'콩나물잡채','당면 대신 콩나물로 잡채를 만들어볼까요~','30분','175Kcal','4인분','https://img.freepik.com/premium-photo/japchae-or-stir-fried-korean-vermicelli-noodles-with-vegetables-and-pork-topped-with-white-sesame-korean-traditiona