8929b85902904d',NULL),(397,'떡꼬치','맛있는 떡꼬치를 집에서 만들어 보세요. 아이들이 너무 좋아하는 간식이랍니다.','30분','299Kcal','4인분','https://img-global.cpcdn.com/recipes/6e999e2b1ed2e091/1200x630cq70/photo.jpg','gTZshh0AczE'),(398,'연어오픈샌드위치','고급스러운 연어로 맛있는 샌드위치를 만들어 보세요. 도시락으로 너무 좋아요^^','30분','399Kcal','2인분','https://static.wtable.co.kr/image/production/service/recipe/832/34501aca-65e4-44e3-bcf9-a8e90db55020.jpg','NsLp6vl1vRs'),(399,'참치김치찌개','간단하고 쉬운 참치김치찌개를 만들어 보세요. 얼큰한 맛을 더하려면 고춧가루를 좀 더 넣어주세요~','30분','186Kcal','2인분','https://img.freepik.com/free-photo/kimchi-jikae-or-kimchi-soup-ready-to-eat-in-bowl_1150-42851.jpg?w=1060&t=st=1664295982~exp=1664296582~hmac=1ad9330b418980e34a28afb006a3de42ab11f85b6499f4ed3a8a67538a8c9d96','3-sOsFQGHhg'),(400,'오징어볶음과소면','매콤하게 고추장과 고춧가루를 넣어 술안주로 너무 좋은 오징어볶음을 만들어보세요.','30분','236Kcal','2인분','https://t1.daumcdn.net/cfile/tistory/9987C3435EF365A32D','hcuXpXBZtyc'),(401,'부추잡채','향긋하고 먹음직스런 싱싱한 부추를 깨끗한 맛이 담긴 청정원 굴소스로 요리해보세요~','30분','206Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2019/04/17/b0b5f4be73128a1cae07d1e4738a31351.jpg','tSc9SgH0fHo'),(402,'쟁반라면','푸짐한 쟁반라면을 만들어 보세요. 꼬들꼬들하게 라면을 삶아서 아삭한 야채와 함께 준비하며 더욱 맛있는 요리가 되지요~','40분','415Kcal','2인분','https://img.freepik.com/premium-photo/ramyoen-or-ramyun-korean-style-instant-noodlewith-spicy-flavour-topped-with-egg-yolk-chilli-and-etc_431906-1626.jpg?w=1060',NULL),(403,'불고기꽃만두','치자로 예쁜 색깔을 내어 특별한 만두를 만들어 보세요.','30분','421Kcal','2인분','http://www.menupan.com/cook/cookimg/110800.jpg','hXJ5HhL-ts4'),(404,'해물샤브샤브','온가족이 둘러 앉아 해물을 육수에 퐁당퐁당! 간단하게 준비하여 푸짐하게 드실 수 있답니다','30분','296Kcal','2인분','https://imagescdn.gettyimagesbank.com/500/201708/jv10926308.jpg','NW6NJ0SU0Uw'),(405,'간장게장','담백하고 짜지 않은 간장게장을 만들어보세요. 밥도둑이 따로 없답니다.','60분','136Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2018/06/04/11726b13d3cb7b41cb0373258837d38b1.jpg','c8euGxGY32I'),(406,'녹두죽','건강에 좋은 죽을 요리해보세요. 입맛이 없을때 한그릇 뚝딱!','60분','280Kcal','2인분','https://folkency.nfm.go.kr/upload/img/20190228/20190228171632_t_.jpg','jdDBBTdc_-I'),(407,'돼지불고기','저녁 반찬 뭐