','IMZXVZIhGsk'),(417,'생선전','담백한 대구살로 맛있는 전을 부쳐보세요. 고급스러운 맛을 더하려면 쑥갓을 한잎~','30분','166Kcal','2인분','https://www.menupan.com/common/service/img_proxy.asp?src=http%3A%2F%2Fpostfiles11.naver.net%2F20150218_298%2Fridiastory_1424216878196QzIDl_JPEG%2F084.JPG%3Ftype%3Dw1','2R6mevUD4yM'),(418,'통마늘장아찌','반찬용으로 새콤달콤하게 만들어보세요~','40분','56Kcal','2인분','https://t1.daumcdn.net/cfile/tistory/9951E6395B1C981C03','c9OuIUSvjGk'),(419,'북어해장국밥','포송포송한 북어로 담백한 북어해장국밥을 만들어보세요. 아침식사로 아주 그만이죠!','30분','493Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2016/02/28/60e81dbd986a56400a9804411d79817c1.jpg','2qLRSaQYO6k'),(420,'봄동겉절이','뜨거운 밥위에 겉절이를 맛있게 올려 먹으면 없던 입맛이 새록새록 살아납니다! 봄동의 향긋한 향도 너무 좋아요.','30분','78Kcal','2인분','https://i.ytimg.com/vi/EDuo3mC9W-s/maxresdefault.jpg','UlsvKb-Bafs'),(421,'양파전','쇠고기를 곱게 다져서 소를 만들어 아삭한 양파안에 채워넣지요. 기름에 노릇하게 구워내면 아주 맛있는 양파전이 됩니다!','30분','165Kcal','2인분','https://img.freepik.com/premium-photo/korean-pancakes-with-green-onion-and-soy-sauce_317094-191.jpg?w=360','0Qk76A7D-r8'),(422,'꽃상추쌈','싱싱한 상추를 준비하여 그 위에 맛있게 양념한 밥을 올려보세요~ 모양도 굿 맛도 굿!','30분','352Kcal','2인분','http://www.menupan.com/cook/cookimg/119900.jpg','u-hzriZXTy4'),(423,'돼지고기우엉말이조림','영양가 풍부한 돼지고기에 우엉을 넣어 돌돌 말았답니다. 맛있는 양념간장에 조려보세요! 밥반찬으로도 너무 좋구요~','30분','170Kcal','2인분','http://www.menupan.com/cook/cookimg/120100.jpg','oHWCjIbU0IY'),(424,'다시마채소말이','다이어트를 하신다면 깔끔한 다시마 야채 말이를 만들어보세요! 여러가지 야채와 다시마가 아주 잘 어울려요.','30분','123Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2017/12/18/18d0dc15735c521c408e384ce02383a71.jpg','Lu9uLi6qrf4'),(425,'무말랭이무침','양념장을 맛있게 만들어 무말랭이를 맛있게 조물조물 무쳐보세요.','20분','69Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2019/04/10/2541ac043943de2c7dd90248e6bbcde51.jpg','MZmW3NQYHwQ'),(426,'낙지불고기','낙지와 불고기가 만났다? 낙지와 불고기를 맛있게 양념해서 얼큰하고 담백한 전골 요리를 해보세요.','40분','393Kcal','2인분','https://t1.daumcdn.net/cfile/tistory/1159743E4F5B07B62E','Y8CD283Xu6o'),(427,'돌솥비빔밥','뜨근한 돌솥에 여러가지 재료들을 넣어 맛있는 돌솥비빔밥을 만들어보세요~','30분','521Kcal','2인분','https://i.ytimg.com/vi/asDQQWRS1uY/maxresdefault.jpg','ZMYtYwjLQCE'),(428,'고등어양념구이','고등어에 양념장 솔솔 발라서 중불이나 약불에서 구워보세요.','30분','175Kcal','2인분','https://mblogthumb-phinf.pstatic.net/20140108_17/dew36_1389138437987cf1lu_JPEG/1.jpg?type=w2','wp4tO6jO8Wo'),(429,'고등어조림','오늘 저녁에는 고등어조림으로 밥 한끼 해결합시다. 간이 밴 무도 맛이 일품이죠~','30분','250Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2018/10/24/90cc887f3c65d5dda31b260cc8b439d41.jpg','ZMYtYwjLQCE'),(430,'갈치구이','갈치구이를 접시에 담을 땐 레몬을 한조각 올려서 더욱 이쁘게! 보기 좋은게 먹기도 좋답니다~','15분','165Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2015/08/09/7701e571266c7963643b4a89e50d19881.jpg','sFoXxMLxu3U'),(431,'갈치조림','밥 한그릇 생각나게 하는 갈치조림이죠!','30분','240Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2015/06/29/032b7baf524f3ccc8229c631365a4237.jpg','-LTpZI4fq4I'),(432,'새우겨자채','톡쏘는 겨자소스에 버무린 오동통한 새우가 참 맛있답니다.','30분','135Kcal','2인분','https://img.freepik.com/premium-photo/korean-style-pickled-prawns-or-korean-soy-sauce-pickled-shrimp-asian-food-style_1339-159768.jpg',NULL),(433,'치즈멸치볼','치즈와 멸치가 들어가서 칼슘과 단백질이 아주 아주 풍부한 요리입니다. 아이들의 오늘 간식은 치즈멸치볼로 해결하세요.','20분','287Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2019/12/13/ac765099419003d25d927b8bdd4a08da1.jpg','7Innf-KpEO0'),(434,'채소치즈죽','아침을 꼭꼭 챙겨먹어야지만이 하루도 든든하고 머리회전도 빨라진데요. 채소치즈죽으로 아침 절대 거르지 마세요~','20분','268Kcal','1인분','https://recipe1.ezmember.co.kr/cache/recipe/2016/11/19/e55de2a5bc1b334e37486cdb3bf32db01_m.jpg','jCWM-a6NEbg'),(435,'수삼치즈샐러드','힘이 불끈 솟아나는 수삼과 비타민이 풍부한 야채들을 넣어 상큼하게 버무린 수삼치즈샐러드로 잃어버린 입맛을 살리세요~','20분','264Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2016/06/09/84817936697993c0462452d3aaba2cfb1.jpg','GVV7kzJsa2w'),(436,'마늘볶음국수','마늘을 버터에 볶으면 고소하고도 향긋한 맛이 일품이예요. 생숙주를 넣어서 더욱 맛을 낸 퓨전요리를 소개합니다.','30분','450Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2015/08/26/fb8c0b9238ed2ea67568eb617dfd3af4.jpg','wK9OHVxB_Z8'),(437,'쌀국수','베트남 고유의 시원한 쌀국수 요리를 우리집 가정에서 느껴보세요~ 담백한 육수와 상큼한 숙주가 일품이예요!','30분','385Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2020/09/06/ee00d6e59def943bc0eb0354fb58a00d1.jpg','q