9,'서리태콩국수','여름 더위를 물리치는 단골손님, 시원한 콩국수! 쫄깃한 면발과 고소한 국물맛이 환상이죠.','30분','489Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2018/07/05/1185b60890d43da77262f607f86796601.jpg','JJjdnekZT40'),(460,'대대로닭칼국수','닭육수로 만든 시원한 국물맛과 콩가루로 빚은 고소한 면발이 잘 어울리는 따끈따끈한 칼국수 대령이요!','30분','235Kcal','2인분','https://mblogthumb-phinf.pstatic.net/20160422_202/2j_luv_1461330259939lyM2q_JPEG/NaverBlog_20160422_220418_10.jpg?type=w2','5Ceg1QN56p0'),(461,'전어회무침','입맛 없을 때는 새콤달콤한 전어회무침이 최고에요. 입안에 군침이 좌르르 돌아요.','30분','187Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2019/10/09/32187c50874e61fc5450e4b5a649365b1.jpg','Bs3BdGw7zn4'),(462,'왕새우구이와구운채소','각종 허브오일에 마리네이드한 왕새우를 오븐에 먹기좋게 구워 톡쏘는 와사비감자와 즐겨보세요.','40분','285Kcal','2인분','https://img.freepik.com/premium-photo/delicious-bowl-of-scampi-prawns-with-garlic-butter-and-parsley-top-view-free-copy-space_187166-15593.jpg?w=1380','CHRFnlzze7g'),(463,'소꼬리찜','몸이 허하다고 생각이 들때는 소꼬리찜으로 원기회복해 보세요. 국물이 있어서 해장에도 아주 좋아요.','60분','457Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2018/03/07/3ae12f088c9968a5b105b459d1f7e1781.jpg','0wWuwGAwRtw'),(464,'삼색나물월남쌈','삼색나물과 고기산적을 각종 채소들과 함께 부드러운 라이스 페이퍼에 싸드세요. 세가지 소스중에 무엇을 찍어먹을지 행복한 고민을 해볼까요.','30분','251Kcal','2인분','http://www.menupan.com/cook/cookimg/148200.jpg','9niMEr3w368'),(465,'토란닭고기찜','닭고기 살에 적당히 배인 간장소스가 너무나도 맛있는거 있죠. 담백한 토란과 함께 즐겨줘요.','30분','310Kcal','2인분','http://www.menupan.com/cook/cookimg/148400.jpg','GqtAkddzRKw'),(466,'녹두고물호박떡케이크','은은한 연두색 녹두고물이 덮인 호박떡케이크랍니다. 설탕은 조금만 첨가시키고 단호박의 자연적인 단맛을 즐겨보세요.','70분','264Kcal','2인분','http://www.menupan.com/cook/cookimg/148800.jpg','sPqL0Nebf2Y'),(467,'크림소스파스타','남녀노소 좋아하는 크림파스타! 이젠 집에서도 즐겨보세요~','60분','350Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2016/08/01/852bfdb3627182aa05afa4a40d6f2c4d1.jpg','AK0dcuydkiM'),(468,'상추미소국','냉장고에 먹다 남은 상추 있으신가요? 그럼 시원한 미소국에 한 번 넣어보세요~ 상추의 향과 미소된장의 향이 아주 잘 어울려요!','20분','53Kcal','2인분','http://www.menupan.com/cook/cookimg/150000.jpg','XT7rDf_99hY'),(469,'가지김치','오늘은 아삭한 가지로 만든 김치! 과연 어떤 맛일까요?','30분','45Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2015/09/25/913ff4de34648513b33403e8a4be96db1.jpg','Ofc_tiRRir8'),(470,'버섯잡채','당면 대신 버섯을 이용해 고소한 잡채를 만들어 보세요.','30분','201Kcal','2인분','https://img.freepik.com/premium-photo/soy-glass-noodles-with-shiitake-mushrooms-and-chicken-meat-wooden-table-top-view_89816-19333.jpg?w=1060','igEdYI-6zpk'),(471,'부추올리브오일무침','기름기가 없어 질겨지거나 퍽퍽할 수 있는 부추무침에 올리브오일을 첨가해 보세요. 윤기가 흐르는 부추무침을 보면 입맛이 돌아와요.','20분','43Kcal','2인분','http://www.menupan.com/cook/cookimg/151500.jpg','igEdYI-6zpk'),(472,'바베큐립','패밀리레스토랑의 맛을 재현하다~ 그 맛이 바로 바비큐립!','60분','241Kcal','2인분','https://i.ytimg.com/vi/cgmQSWtMMzk/maxresdefault.jpg','jP7GgeUkZII'),(473,'무쌈말이','비트로 물을 들여 색깔이 아주 화려하답니다. 온갖 채소들을 돌돌 말아 특히 여성분들에게 좋아요','30분','110Kcal','2인분','https://static.wtable.co.kr/image/production/service/recipe/687/dff897a9-5d88-4491-88f5-d8fa15e49dbc.jpg','5eKwNuMiDd4'),(474,'치킨샐러드','느끼하지 않은 닭가슴살로 만든 샐러드랍니다. 달콤한 허니머스터드를 뿌려드세요!','30분','295Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2016/01/15/d379040cd3ebdb7b3eb33e080cd24a101.jpg','NNQVM35goK8'),(475,'된장채소수제비','된장은 음식의 간과 맛을 보태주는 역할과 함께 식물성 단백질로 구성되어 버릴 것 하나 없는 기특한 식품입니다.','30분','350Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2022/06/21/1892e6ecdd6da13aaabdaf1a46dfcccd1.jpg','gvJAqSMKEiY'),(476,'고추장닭강정','고추장으로 매콤 달콤하게 맛을 낸 닭강정을 만들어보세요..모두가 즐길 수 있는 요리랍니다.','40분','385Kcal','2인분','https://post-phinf.pstatic.net/MjAxODA4MjNfMjE3/MDAxNTM1MDAzODMyNjUw.jfBDvMSlYNh5O8MW3z0Vxcvf5fr0e3IJqA7uJvcE90sg.PcTGxhcrFvewaQrsEmsJaeN2y-lpfNht2VEFCUZZXtQg.JPEG/DSC05341.JPG?type=w1200','RUDPussbU04'),(477,'참치죽','고소한 참치가 들어가 심심하지 않아요~','30분','296Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2021/06/29/046731b221baae81a24e6382b57a95711.jpg','CPW9x9lqA4Q'),(478,'두부파프리카전','고소한 두부의 맛을 살려주는 포도씨유로 두부 파프리카전을 지져보세요. 느끼하지 않은 기름이 음식맛을 살려준답니다~','30분','96Kcal','2인분','https://blog.kakaocdn.net/dn/QWB3r/btq53RLmHpV/TyllyxW3ZvK8v2KEMnkxy0/img.jpg','5UN9Z6La6Mc'),(479,'고추잡채와꽃빵','매콤한 고추잡채에 쫄깃한 꽃빵을 곁들여 드셔보세요~','30분','110Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2019/02/23/068ad96d629a4bdae9ff5d20c8e650ca1.jpg','KVrYb3yP53A'),(480,'해물찌개','개운한 국물 한술 뜨면 피로가 싹 날아가는 시원한 해물찌개~ 쌀쌀한 날씨엔 시원한 국물이 최고랍니다!','30분','165Kcal','4인분','https://recipe1.ezmember.co.kr/cache/recipe/2020/07/06/efd6dd5f86cd021de32d911aa64728211.jpg','FFAWo5VS56c'),(481,'돼지고기김치찌개','개운한 김치찌개~! 신김치와 청정원 국선생 육수만  있으면 감칠맛 나는 요리는 문제 없답니다.','30분','120Kcal','4인분','https://img.freepik.com/free-photo/kimchi-jikae-or-kimchi-soup-ready-to-eat-in-bowl_1150-42851.jpg?w=1060&t=st=1664295982~exp=1664296582~hmac=1ad9330b418980e34a28afb006a3de42ab11f85b6499f4ed3a8a67538a8c9d96','-tqtwqROtTE'),(482,'두부조림','바삭한 두부를 감칠맛나는 굴소스에 부드럽게 조렸어요~ 술안주로 밥반찬으로 인기 만점이에요!','30분','108Kcal','4인분','https://i.ytimg.com/vi/P_4fUXQ5nyo/maxresdefault.jpg','ob2CYmTx9PM'),(483,'오코노미야키','부슬부슬 비오는 날~ 가다랑이포 솔솔뿌린 따끈한 오코노미야키를 만들어보세요! 집에서도 훌륭한 맛내기! 한번 시작해 볼까요~?','30분','350Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2017/02/21/3a20a63e4efacbcfc47571c7a7bac2601.jpg','Y33iFBt1_PA'),(484,'해물볶음밥','빠른 요리가 필요할 땐 맛도 함께 챙겨주는 굴소스로 요리해보세요~','30분','362Kcal','2인분','https://img.freepik.com/premium-photo/fried-rice-with-egg-in-korean-style-asian-food-style_1339-168162.jpg?w=1060','-YO63Wnz_Vo'),(485,'새송이쌈장구이','쫄깃한 새송이를 개운한 쌈장에 재워 구워보세요~','30분','85Kcal','2인분','https://t1.daumcdn.net/blogfile/fs11/10_blog_2008_02_09_04_45_47acb158b36b9?x-content-disposition=inline&filename=159500.jpg','qsKecJ7RWRM'),(486,'해물매운탕','매콤하면서 시원한 해물탕으로 개운하게 속풀이 하세요!','60분','265Kcal','4인분','https://img.freepik.com/premium-photo/kimchi-udon-with-shrimp-and-pork-in-kimchi-soup-asian-food-style_28710-1865.jpg?w=1060','7txoB9qnKWs'),(487,'해물순두부찌개','부드럽게 넘어가는 맛이 최고!! 시원하고 개운한 국물맛이 단백하게 입맛을 살려주는 순두부찌개!!','30분','165Kcal','4인분','https://recipe1.ezmember.co.kr/cache/recipe/2015/11/20/11f57d6cc44a3bcbd1fcdabf89e2f3f31.jpg','Mg9zeD01kEw'),(488,'김치우동','칼칼한 국물이 땡기는 날~ 김치우동으로 시원함을 달래보세요!','30분','293Kcal','2인분','https://homecuisine.co.kr/files/attach/images/140/602/106/8318782fd5c2fac8b0bf6bc8baeaf2cf.jpg','zHGC16878g8'),(489,'쫄면','쫄깃하고 새콤달콤한 쫄면~ 차고 매콤한 맛이 자꾸자꾸 땡겨요!','40분','267Kcal','4인분','https://img.freepik.com/premium-photo/ramyeon-or-korean-instant-noodles-with-egg-korean-food-style_1339-148898.jpg?w=1060','vIctJQVZ3bk'),(490,'발효초요구르트','발효초를 넣어 더욱 개운한 요구르트 한 잔이면 하루가 상쾌해요~','10분','142Kcal','4인분','http://www.menupan.com/cook/cookimg/162600.jpg','APRfQkf7n78'),(491,'채소피클','새콤 달콤 아삭한 피클을 집에서 즐겨보세요~ 발효초가 들어가 건강까지 살아있어요~','20분','37Kcal','2인분','https://i.ytimg.com/vi/Uv4cErhVD1M/maxresdefault.jpg','i2LJI1DpgiY'),(492,'떡만두국','따끈한 국물이 생각날 때! 쫄깃한 떡과 속살 탱탱한 만두가 들어간 떡만두국 어떠세요~','30분','425Kcal','2인분','https://img.freepik.com/premium-photo/mandu-tteokguk-soup-or-slice-rice-cake-and-dumpling-soup-seollal-festival-food-top-view-on-yellow-background_511235-7863.jpg','kIaIGJt4NO0'),(493,'꽁치김치찌개','김치찌개가 지겨우시다구요? 꽁치를 넣어 칼칼하고 시원한 꽁치김치찌개! 추운 날 밥반찬으로 그만이지요~','60분','423Kcal','4인분','https://img.freepik.com/free-photo/kimchi-jikae-or-kimchi-soup-ready-to-eat-in-bowl_1150-42851.jpg?w=1060&t=st=1664295982~exp=1664296582~hmac=1ad9330b418980e34a28afb006a3de42ab11f85b6499f4ed3a8a67538a8c9d96','TxiXohZH9EI'),(494,'미소된장국','단백한 국물맛이 좋은 미소된장국으로 속을 가볍게 달래보세요~','30분','56Kcal','2인분','https://recipe1.ezmember.co.kr/cache/recipe/2017/06/28/1b4ba3c855623497b93bfa761430484d1.jpg','Slj_fM1jQVo'),(495,'비빔냉면','더운 여름, 시원하고 새콤달콤한 비빔냉면을 비벼비벼~','50분','630Kcal','4인분','https://img.freepik.com/premium-photo/korean-spicy-cold-noodles-bibim-makguksu-or-bibim-guksu-korean-food-style_1339-154985.jpg?w=1060','8l9_OE9c6vg'),(496,'메기매운탕','메기와 각종 채소를 넣어 얼큰하게 끓인 탕 요리','60분','169Kcal','4인분','https://m.junginfood.com/file_data/junginfood01/2020/12/29/fd8019cdf6e710a2de0921a8d5dcdc17.jpg','b2D-vrwEhcg'),(497,'잉어찜','잉어에 고명을 얹어 찐요리입니다. 특별한날 드셔보세요.','30분','138Kcal','4인분','https://recipe1.ezmember.co.kr/cache/recipe/2019/02/28/ef80d74efc207acd82469f7c5dbcd5971.jpg','gznzwfq4oKA'),(498,'송어샐러드','신선한 채소와 송어에 상큼한 파인애플 드레싱을 얹은 요리','30분','113Kcal','4인분','https://t1.daumcdn.net/cfile/blog/233E723B524CD20532','9-Rx8i-KRLg'),(499,'까르보나라 (한국식)','전통식과는 다르게 생크림을 넣어 소스가 많은 한국식 까르보나라','30분','652Kcal','1인분','https://recipe1.ezmember.co.kr/cache/recipe/2020/09/14/a99fd663afc1afe0cf8718130de1674f1.jpg','3AAdKl1UYZs'),(500,'쌀샐러드','낙지와 야채를 곁들인 쌀 샐러드로 이탈리아에서 즐겨먹는 쌀요리.','40분','426Kcal','2인분','https://mblogthumb-phinf.pstatic.net/20150808_2/mitico_1438961923771xFXh1_JPEG/IMG_8955.jpg?type=w2','h6wsidxJvlA'),(501,'Omurice','OmuriceOmuriceOmuriceOmurice','30qn','442kasd','2sakdas','https://mblogthumb-phinf.pstatic.net/20150808_2/mitico_1438961923771xFXh1_JPEG/IMG_8955.jpg?type=w2','h6wsidxJvlA');
